[{"location":"getting-started/installation/#Installation","page":"Installation","title":"Installation","text":"","category":"section"},{"location":"getting-started/installation/","page":"Installation","title":"Installation","text":"CensoredDistributions is available in the Julia registry. Install it by running the following command in the Julia REPL:","category":"page"},{"location":"getting-started/installation/","page":"Installation","title":"Installation","text":"using Pkg; Pkg.add(\"CensoredDistributions\")","category":"page"},{"location":"lib/internals/#Internal-Documentation","page":"Internal API","title":"Internal Documentation","text":"","category":"section"},{"location":"lib/internals/","page":"Internal API","title":"Internal API","text":"Documentation for CensoredDistributions.jl's internal interface.","category":"page"},{"location":"lib/internals/#Contents","page":"Internal API","title":"Contents","text":"","category":"section"},{"location":"lib/internals/","page":"Internal API","title":"Internal API","text":"Pages = [\"internals.md\"]\nDepth = 2:2","category":"page"},{"location":"lib/internals/#Index","page":"Internal API","title":"Index","text":"","category":"section"},{"location":"lib/internals/","page":"Internal API","title":"Internal API","text":"Pages = [\"internals.md\"]","category":"page"},{"location":"lib/internals/#Internal-API","page":"Internal API","title":"Internal API","text":"","category":"section"},{"location":"lib/internals/#Base.rand-Tuple{Random.AbstractRNG, CensoredDistributions.IntervalCensored}","page":"Internal API","title":"Base.rand","text":"rand(\n    rng::Random.AbstractRNG,\n    d::CensoredDistributions.IntervalCensored\n) -> Any\n\n\nGenerate a random sample by discretising a sample from the underlying distribution.\n\nSee also: quantile\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Base.rand-Tuple{Random.AbstractRNG, CensoredDistributions.PrimaryCensored}","page":"Internal API","title":"Base.rand","text":"rand(\n    rng::Random.AbstractRNG,\n    d::CensoredDistributions.PrimaryCensored\n) -> Any\n\n\nGenerate a random sample by summing samples from delay and primary event distributions.\n\nSee also: quantile\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Base.rand-Tuple{Random.AbstractRNG, CensoredDistributions.Weighted}","page":"Internal API","title":"Base.rand","text":"rand(\n    rng::Random.AbstractRNG,\n    d::CensoredDistributions.Weighted\n) -> Any\n\n\nGenerate a random sample (delegates to underlying distribution).\n\nSee also: quantile\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Base.rand-Tuple{Random.AbstractRNG, ExponentiallyTilted}","page":"Internal API","title":"Base.rand","text":"rand(rng::Random.AbstractRNG, d::ExponentiallyTilted) -> Any\n\n\nGenerate a random sample using inverse transform sampling.\n\nSee also: quantile\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#CensoredDistributions._collect_unique_boundaries-Tuple{CensoredDistributions.IntervalCensored, AbstractVector{<:Real}}","page":"Internal API","title":"CensoredDistributions._collect_unique_boundaries","text":"_collect_unique_boundaries(\n    d::CensoredDistributions.IntervalCensored,\n    x::AbstractVector{<:Real}\n) -> Any\n\n\n_collect_unique_boundaries(d::IntervalCensored, x::AbstractVector)\n\nCollect all unique interval boundaries needed for vectorised PDF computation.\n\nReturns a sorted vector of unique boundaries with appropriate type promotion.\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#CensoredDistributions._compute_pdfs_with_cache-Tuple{CensoredDistributions.IntervalCensored, AbstractVector{<:Real}, Dict}","page":"Internal API","title":"CensoredDistributions._compute_pdfs_with_cache","text":"_compute_pdfs_with_cache(\n    d::CensoredDistributions.IntervalCensored,\n    x::AbstractVector{<:Real},\n    cdf_lookup::Dict\n) -> Any\n\n\n_compute_pdfs_with_cache(d::IntervalCensored, x::AbstractVector, cdf_lookup::Dict)\n\nCompute PDFs efficiently using cached CDF values.\n\nUses the same boundary case handling as the scalar method.\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#CensoredDistributions._gamma_cdf_ad_safe-Tuple{Real, Real, Real}","page":"Internal API","title":"CensoredDistributions._gamma_cdf_ad_safe","text":"_gamma_cdf_ad_safe(k::Real, θ::Real, x::Real) -> Any\n\n\nAD-compatible gamma CDF using HypergeometricFunctions.\n\nBased on the identity: γ(a,z) = z^a/a * M(a, a+1, -z) where γ is the lower incomplete gamma function and M is the confluent hypergeometric function.\n\nUses the same approach as the Weibull g function: P(a,z) = γ(a,z)/Γ(a) = z^a/a * M(a, a+1, -z) / Γ(a). For integer a, Γ(a) = (a-1)!, but uses gamma(k) for generality.\n\nArguments\n\nk::Real: Shape parameter\nθ::Real: Scale parameter\nx::Real: Evaluation point\n\nReturns\n\nThe gamma CDF value at x with shape k and scale θ.\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#CensoredDistributions._make_weibull_g-Tuple{Real, Real}","page":"Internal API","title":"CensoredDistributions._make_weibull_g","text":"_make_weibull_g(\n    k::Real,\n    λ::Real\n) -> CensoredDistributions.var\"#weibull_g_specialized#1\"{<:Real, <:Real}\n\n\nFunction factory for optimized Weibull g function.\n\nCreates a specialized function with pre-computed constants for g(t; k, λ) = γ(1 + 1/k, (t/λ)^k) where γ is the lower incomplete gamma function.\n\nPre-computes inv_k = 1/k and a = 1 + inv_k to avoid repeated computation in the returned specialized function.\n\nArguments\n\nk::Real: Weibull shape parameter\nλ::Real: Weibull scale parameter\n\nReturns\n\nA specialized function weibull_g_specialized(t::Real) that efficiently computes the Weibull g function using pre-computed constants.\n\nExamples\n\nweibull_g_func = _make_weibull_g(2.0, 1.5)\ng_val = weibull_g_func(3.0)\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#CensoredDistributions._quantile_optimization-Tuple{Any, Real}","page":"Internal API","title":"CensoredDistributions._quantile_optimization","text":"_quantile_optimization(\n    d,\n    p::Real;\n    initial_guess_fn,\n    result_postprocess_fn,\n    check_nan\n) -> Any\n\n\nInternal function for quantile optimization using numerical methods.\n\nSolves the equation cdf(d, q) - p = 0 using the Nelder-Mead algorithm. This is shared logic used by both PrimaryCensored and IntervalCensored quantile functions.\n\nArguments\n\nd: The distribution for which to compute the quantile\np: The probability value in [0, 1]\n\nKeyword Arguments\n\ninitial_guess_fn: Function that takes (d, p) and returns initial guess vector. If nothing, uses quantile(get_dist(d), p) as scalar initial guess.\nresult_postprocess_fn: Function to post-process the optimization result. Defaults to identity (no post-processing).\ncheck_nan: If true, explicitly check for NaN input values.\n\nReturns\n\nThe quantile value after optimization and post-processing.\n\nImplementation Details\n\nValidates that p ∈ [0, 1] (with optional NaN checking)\nHandles boundary cases p=0 (minimum) and p=1 (maximum) analytically\nCreates objective function (cdf(d, q) - p)^2 with support checking\nUses heavy penalty for values outside distribution support\nSolves with Nelder-Mead algorithm with tight tolerances\nChecks convergence and applies post-processing to result\n\nType Stability\n\nThis function is designed to maintain type stability when the initial guess function and post-processing function are type-stable.\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#CensoredDistributions.combine_weights-Tuple{Missing, Missing}","page":"Internal API","title":"CensoredDistributions.combine_weights","text":"combine_weights(_::Missing, _::Missing) -> Missing\n\n\nCombine constructor weight with observation weight using dispatch-based rules.\n\nWeight combination rules:\n\nmissing, missing → missing (both missing means no weight)\nw1, missing → w1 (use constructor weight)\nmissing, w2 → w2 (use observation weight)\nw1, w2 → w1 * w2 (multiply weights)\n\nVector Extensions\n\nFor Product distributions, additional methods handle vectorised weight combinations:\n\nVector, Vector → combine_weights.(vector1, vector2) (element-wise combination)\nVector, missing → Vector (keep constructor weights)\nVector, scalar → [combine_weights(w, scalar) for w in Vector] (broadcast scalar)\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.ccdf-Tuple{CensoredDistributions.Weighted, Real}","page":"Internal API","title":"Distributions.ccdf","text":"ccdf(d::CensoredDistributions.Weighted, x::Real) -> Any\n\n\nCompute the complementary cumulative distribution function (delegates to underlying distribution).\n\nSee also: cdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.cdf-Tuple{CensoredDistributions.IntervalCensored, Real}","page":"Internal API","title":"Distributions.cdf","text":"cdf(\n    d::CensoredDistributions.IntervalCensored,\n    x::Real\n) -> Any\n\n\nCompute the cumulative distribution function.\n\nSee also: logcdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.cdf-Tuple{CensoredDistributions.PrimaryCensored, Real}","page":"Internal API","title":"Distributions.cdf","text":"cdf(\n    d::CensoredDistributions.PrimaryCensored,\n    x::Real\n) -> Any\n\n\nCompute the cumulative distribution function.\n\nSee also: logcdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.cdf-Tuple{CensoredDistributions.Weighted, Real}","page":"Internal API","title":"Distributions.cdf","text":"cdf(d::CensoredDistributions.Weighted, x::Real) -> Any\n\n\nCompute the cumulative distribution function (delegates to underlying distribution).\n\nSee also: logcdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.cdf-Tuple{ExponentiallyTilted, Real}","page":"Internal API","title":"Distributions.cdf","text":"cdf(d::ExponentiallyTilted, x::Real) -> Any\n\n\nCompute the cumulative distribution function.\n\nSee also: logcdf, quantile\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logccdf-Tuple{CensoredDistributions.Weighted, Real}","page":"Internal API","title":"Distributions.logccdf","text":"logccdf(d::CensoredDistributions.Weighted, x::Real) -> Any\n\n\nCompute the log complementary cumulative distribution function (delegates to underlying distribution).\n\nSee also: logcdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logcdf-Tuple{CensoredDistributions.IntervalCensored, Real}","page":"Internal API","title":"Distributions.logcdf","text":"logcdf(\n    d::CensoredDistributions.IntervalCensored,\n    x::Real\n) -> Any\n\n\nCompute the log cumulative distribution function.\n\nSee also: cdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logcdf-Tuple{CensoredDistributions.PrimaryCensored, Real}","page":"Internal API","title":"Distributions.logcdf","text":"logcdf(\n    d::CensoredDistributions.PrimaryCensored,\n    x::Real\n) -> Any\n\n\nCompute the log cumulative distribution function.\n\nSee also: cdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logcdf-Tuple{CensoredDistributions.Weighted, Real}","page":"Internal API","title":"Distributions.logcdf","text":"logcdf(d::CensoredDistributions.Weighted, x::Real) -> Any\n\n\nCompute the log cumulative distribution function (delegates to underlying distribution).\n\nSee also: cdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logcdf-Tuple{ExponentiallyTilted, Real}","page":"Internal API","title":"Distributions.logcdf","text":"logcdf(d::ExponentiallyTilted, x::Real) -> Any\n\n\nCompute the log cumulative distribution function.\n\nSee also: cdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logpdf-Tuple{CensoredDistributions.IntervalCensored, AbstractVector{<:Real}}","page":"Internal API","title":"Distributions.logpdf","text":"logpdf(\n    d::CensoredDistributions.IntervalCensored,\n    x::AbstractVector{<:Real}\n) -> Any\n\n\nCompute log probability masses for an array of values using optimised PDF computation.\n\nSee also: pdf, logpdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logpdf-Tuple{CensoredDistributions.IntervalCensored, Real}","page":"Internal API","title":"Distributions.logpdf","text":"logpdf(\n    d::CensoredDistributions.IntervalCensored,\n    x::Real\n) -> Any\n\n\nCompute the log probability mass for the interval containing x.\n\nSee also: pdf, logcdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logpdf-Tuple{CensoredDistributions.PrimaryCensored, Real}","page":"Internal API","title":"Distributions.logpdf","text":"logpdf(\n    d::CensoredDistributions.PrimaryCensored,\n    x::Real\n) -> Any\n\n\nCompute the log probability density function using numerical differentiation of the log CDF.\n\nSee also: pdf, logcdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logpdf-Tuple{CensoredDistributions.Weighted, NamedTuple{(:value, :weight)}}","page":"Internal API","title":"Distributions.logpdf","text":"logpdf(\n    d::CensoredDistributions.Weighted,\n    obs::NamedTuple{(:value, :weight)}\n) -> Any\n\n\nReturn the weighted log-probability for joint observations as NamedTuple.\n\nCombines constructor weight with observation weight via multiplication. Expected format: (value = x, weight = w).\n\nSee also: pdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logpdf-Tuple{CensoredDistributions.Weighted, Real}","page":"Internal API","title":"Distributions.logpdf","text":"logpdf(d::CensoredDistributions.Weighted, x::Real) -> Any\n\n\nReturn the weighted log-probability for scalar observations.\n\nSee also: pdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logpdf-Tuple{Distributions.Product{<:Distributions.ValueSupport, <:CensoredDistributions.Weighted, <:AbstractVector{<:CensoredDistributions.Weighted}}, AbstractVector{<:Real}}","page":"Internal API","title":"Distributions.logpdf","text":"logpdf(\n    d::Distributions.Product{<:Distributions.ValueSupport, <:CensoredDistributions.Weighted, <:AbstractVector{<:CensoredDistributions.Weighted}},\n    x::AbstractVector{<:Real}\n) -> Any\n\n\nEfficient vectorised log-probability computation for Product{<:ValueSupport, <:Weighted} with vector observations.\n\nSee also: logpdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logpdf-Tuple{Distributions.Product{<:Distributions.ValueSupport, <:CensoredDistributions.Weighted, <:AbstractVector{<:CensoredDistributions.Weighted}}, NamedTuple{(:values, :weights)}}","page":"Internal API","title":"Distributions.logpdf","text":"logpdf(\n    d::Distributions.Product{<:Distributions.ValueSupport, <:CensoredDistributions.Weighted, <:AbstractVector{<:CensoredDistributions.Weighted}},\n    obs::NamedTuple{(:values, :weights)}\n) -> Any\n\n\nEfficient vectorised log-probability computation for Product{<:ValueSupport, <:Weighted} with joint observations.\n\nHandles joint observations and weight stacking. Expected format: (values = [...], weights = [...]).\n\nSee also: logpdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.logpdf-Tuple{ExponentiallyTilted, Real}","page":"Internal API","title":"Distributions.logpdf","text":"logpdf(d::ExponentiallyTilted, x::Real) -> Any\n\n\nCompute the log probability density function.\n\nSee also: pdf, cdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.pdf-Tuple{CensoredDistributions.IntervalCensored, AbstractVector{<:Real}}","page":"Internal API","title":"Distributions.pdf","text":"pdf(\n    d::CensoredDistributions.IntervalCensored,\n    x::AbstractVector{<:Real}\n) -> Any\n\n\nCompute probability masses for an array of values using optimised vectorisation.\n\nThis method collects unique interval boundaries, computes CDFs once, then uses cached values for efficient PDF computation across the array.\n\nSee also: pdf, logpdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.pdf-Tuple{CensoredDistributions.IntervalCensored, Real}","page":"Internal API","title":"Distributions.pdf","text":"pdf(\n    d::CensoredDistributions.IntervalCensored,\n    x::Real\n) -> Any\n\n\nCompute the probability mass for the interval containing x.\n\nSee also: logpdf, cdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.pdf-Tuple{CensoredDistributions.PrimaryCensored, Real}","page":"Internal API","title":"Distributions.pdf","text":"pdf(\n    d::CensoredDistributions.PrimaryCensored,\n    x::Real\n) -> Any\n\n\nCompute the probability density function using numerical differentiation.\n\nSee also: logpdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.pdf-Tuple{CensoredDistributions.Weighted, Real}","page":"Internal API","title":"Distributions.pdf","text":"pdf(d::CensoredDistributions.Weighted, x::Real) -> Any\n\n\nReturn the probability density from the underlying distribution (unweighted).\n\nSee also: logpdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.pdf-Tuple{ExponentiallyTilted, Real}","page":"Internal API","title":"Distributions.pdf","text":"pdf(d::ExponentiallyTilted, x::Real) -> Any\n\n\nCompute the probability density function.\n\nSee also: logpdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Distributions.sampler-Tuple{CensoredDistributions.Weighted}","page":"Internal API","title":"Distributions.sampler","text":"sampler(\n    d::CensoredDistributions.Weighted\n) -> Union{CensoredDistributions.Weighted{D, Missing} where D<:(Distributions.UnivariateDistribution), CensoredDistributions.Weighted{D, T} where {D<:(Distributions.UnivariateDistribution), T<:Real}}\n\n\nCreate a sampler for efficient sampling (delegates to underlying distribution).\n\nSee also: rand\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Statistics.mean-Tuple{ExponentiallyTilted}","page":"Internal API","title":"Statistics.mean","text":"mean(d::ExponentiallyTilted) -> Any\n\n\nCompute the mean of the distribution.\n\nSee also: var, std\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Statistics.median-Tuple{ExponentiallyTilted}","page":"Internal API","title":"Statistics.median","text":"median(d::ExponentiallyTilted) -> Any\n\n\nCompute the median of the distribution.\n\nSee also: quantile, mean\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Statistics.quantile-Tuple{CensoredDistributions.IntervalCensored, Real}","page":"Internal API","title":"Statistics.quantile","text":"quantile(\n    d::CensoredDistributions.IntervalCensored,\n    p::Real\n) -> Any\n\n\nCompute the quantile using numerical optimization.\n\nThe returned quantile respects the interval structure:\n\nFor regular intervals: quantiles are multiples of the interval width\nFor arbitrary intervals: quantiles correspond to interval boundary values\n\nSee also: cdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Statistics.quantile-Tuple{CensoredDistributions.PrimaryCensored, Real}","page":"Internal API","title":"Statistics.quantile","text":"quantile(\n    d::CensoredDistributions.PrimaryCensored,\n    p::Real\n) -> Any\n\n\nCompute the quantile (inverse CDF) using numerical optimization.\n\nSee also: cdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Statistics.quantile-Tuple{CensoredDistributions.Weighted, Real}","page":"Internal API","title":"Statistics.quantile","text":"quantile(d::CensoredDistributions.Weighted, p::Real) -> Any\n\n\nCompute the quantile function (delegates to underlying distribution).\n\nSee also: cdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Statistics.quantile-Tuple{ExponentiallyTilted, Real}","page":"Internal API","title":"Statistics.quantile","text":"quantile(d::ExponentiallyTilted, p::Real) -> Any\n\n\nCompute the quantile function (inverse CDF) using analytical formula.\n\nSee also: cdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Statistics.std-Tuple{ExponentiallyTilted}","page":"Internal API","title":"Statistics.std","text":"std(d::ExponentiallyTilted) -> Any\n\n\nCompute the standard deviation of the distribution.\n\nSee also: mean, var\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#Statistics.var-Tuple{ExponentiallyTilted}","page":"Internal API","title":"Statistics.var","text":"var(d::ExponentiallyTilted) -> Any\n\n\nCompute the variance of the distribution.\n\nSee also: mean, std\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#StatsAPI.loglikelihood-Tuple{CensoredDistributions.Weighted, NamedTuple{(:value, :weight)}}","page":"Internal API","title":"StatsAPI.loglikelihood","text":"loglikelihood(\n    d::CensoredDistributions.Weighted,\n    obs::NamedTuple{(:value, :weight)}\n) -> Any\n\n\nCompute log-likelihood for single Weighted distribution with joint observations.\n\nHandles joint observations as NamedTuple: (value = x, weight = w).\n\nSee also: logpdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#StatsAPI.loglikelihood-Tuple{CensoredDistributions.Weighted, NamedTuple{(:values, :weights)}}","page":"Internal API","title":"StatsAPI.loglikelihood","text":"loglikelihood(\n    d::CensoredDistributions.Weighted,\n    obs::NamedTuple{(:values, :weights)}\n) -> Any\n\n\nCompute log-likelihood for single Weighted distribution with vectorized joint observations.\n\nHandles joint observations as NamedTuple: (values = [...], weights = [...]). This is useful when a single weighted distribution is used with multiple observations.\n\nSee also: logpdf\n\n\n\n\n\n","category":"method"},{"location":"lib/internals/#StatsAPI.loglikelihood-Tuple{Distributions.Product{<:Distributions.ValueSupport, <:CensoredDistributions.Weighted, <:AbstractVector{<:CensoredDistributions.Weighted}}, NamedTuple{(:values, :weights)}}","page":"Internal API","title":"StatsAPI.loglikelihood","text":"loglikelihood(\n    d::Distributions.Product{<:Distributions.ValueSupport, <:CensoredDistributions.Weighted, <:AbstractVector{<:CensoredDistributions.Weighted}},\n    obs::NamedTuple{(:values, :weights)}\n) -> Any\n\n\nCompute log-likelihood for Product{<:ValueSupport, <:Weighted} with joint observations.\n\nHandles joint observations as NamedTuple: (values = [...], weights = [...]).\n\nSee also: logpdf\n\n\n\n\n\n","category":"method"},{"location":"getting-started/julia/#julia","page":"Julia","title":"Getting Started with Julia","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"This guide helps you set up Julia for working effectively with CensoredDistributions.jl, whether you're using the package for analysis or contributing to its development. It's aimed at people familiar with other technical computing languages (R, Python, MATLAB) but new to Julia workflows.","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"note: Note\nIf you're familiar with other languages for technical computing, these noteworthy differences may be useful.","category":"page"},{"location":"getting-started/julia/#What-this-guide-is-and-isn't","page":"Julia","title":"What this guide is and isn't","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"This isn't a comprehensive guide to learning Julia programming. Instead, we provide practical setup advice to get you working productively with CensoredDistributions.jl quickly.","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"To learn Julia programming, we recommend:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Julia Documentation - getting started\nJulia learning resources\nJulia Discourse - community forum","category":"page"},{"location":"getting-started/julia/#Julia-Installation-with-juliaup","page":"Julia","title":"Julia Installation with juliaup","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Download juliaup: This is the official cross-platform installer/updater for Julia. Go to the juliaup GitHub repository for installation instructions.\nVerify Installation: Open a terminal and type julia to start the Julia REPL. You should see a Julia prompt julia>.","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Why juliaup? Easy version management, automatic updates, and seamless switching between Julia versions for different projects.","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"👉 Learn more: juliaup GitHub repository for detailed usage instructions.","category":"page"},{"location":"getting-started/julia/#Editor-Setup:-VSCode-with-Julia-Extension","page":"Julia","title":"Editor Setup: VSCode with Julia Extension","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Recommended setup:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Install Visual Studio Code\nInstall the Julia extension from the VS Code Extensions marketplace (search for \"Julia\")","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Key features:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Integrated REPL: Execute code directly from editor\nTest Explorer: Run individual tests from sidebar with coverage visualization\nDebugging: Set breakpoints, inspect variables, step through code\nPlot viewer: Dedicated pane for visualizations\nSymbol navigation: Go to definitions, find references","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"👉 Learn more: Julia VSCode documentation","category":"page"},{"location":"getting-started/julia/#Julia-Environments","page":"Julia","title":"Julia Environments","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Julia uses environments to manage project dependencies. Each project can have isolated packages and versions.","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Key concepts:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Project.toml: Lists project dependencies\nManifest.toml: Records exact versions (like a lockfile)\nEnvironments can be stacked - global packages available to projects","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"👉 Learn more: Julia Pkg documentation","category":"page"},{"location":"getting-started/julia/#Using-environments-from-the-REPL","page":"Julia","title":"Using environments from the REPL","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"julia> ]                    # Enter package mode\n(@v1.11) pkg> activate .    # Activate current directory as environment\n(myproject) pkg> add SomePackage   # Add package to project\n(myproject) pkg> status     # See what's installed","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Common commands:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"activate . - activate current directory as environment\nactivate --temp - create temporary environment for experiments\ninstantiate - install all dependencies listed in Project.toml","category":"page"},{"location":"getting-started/julia/#Recommended-packages-for-your-global-Julia-environment","page":"Julia","title":"Recommended packages for your global Julia environment","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Install these in your Julia version environment (e.g., @v1.11) to make them available across projects:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"julia> ]\n(@v1.11) pkg> add Revise OhMyREPL BenchmarkTools TestEnv","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Recommended packages:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Revise: Automatic code reloading - essential for development\nOhMyREPL: Better REPL with syntax highlighting\nBenchmarkTools: Performance measurement\nTestEnv: Easy switching to test environments","category":"page"},{"location":"getting-started/julia/#startup.jl-configuration","page":"Julia","title":"startup.jl configuration","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Automatically load essential tools by creating ~/.julia/config/startup.jl:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"atreplinit() do repl\n    # Load Revise for automatic code reloading\n    try\n        @eval using Revise\n    catch e\n        @warn \"error while importing Revise\" e\n    end\n\n    # Load OhMyREPL for better REPL experience\n    try\n        @eval using OhMyREPL\n    catch e\n        @warn \"error while importing OhMyREPL\" e\n    end\n\n    # Pkg convenience functions\n    try\n        @eval using Pkg\n        @eval st() = Pkg.status()\n        @eval up() = Pkg.update()\n    catch e\n        @warn \"error while importing Pkg\" e\n    end\nend","category":"page"},{"location":"getting-started/julia/#Working-with-CensoredDistributions.jl","page":"Julia","title":"Working with CensoredDistributions.jl","text":"","category":"section"},{"location":"getting-started/julia/#Installing-and-using-the-package","page":"Julia","title":"Installing and using the package","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"julia> ]\n(@v1.11) pkg> add CensoredDistributions\njulia> using CensoredDistributions\n\n# Start using the package\njulia> using Distributions\njulia> primary_censored(Gamma(2, 1), Uniform(0, 1))","category":"page"},{"location":"getting-started/julia/#Working-with-the-tutorials","page":"Julia","title":"Working with the tutorials","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"The tutorials include interactive Pluto notebooks. See the FAQ for detailed instructions on running the notebooks vs. copying code.","category":"page"},{"location":"getting-started/julia/#Development-workflow-(for-contributors)","page":"Julia","title":"Development workflow (for contributors)","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"If you want to contribute to the package, see the Contributing Guide and Developer FAQ for detailed guidance.","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"# Clone and enter package directory\ngit clone https://github.com/EpiAware/CensoredDistributions.jl.git\ncd CensoredDistributions.jl\n\n# Start Julia in package environment\njulia --project=.","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"julia> using CensoredDistributions  # Load package (automatically reloads with Revise)\n\n# Make changes to source code - they reload automatically\n# Test changes interactively\njulia> primary_censored(Gamma(2, 1), Uniform(0, 1))","category":"page"},{"location":"getting-started/julia/#Running-tests","page":"Julia","title":"Running tests","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"julia> ]\n(CensoredDistributions) pkg> test    # Run all tests\n\n# Or from command line\njulia --project=. -e 'using Pkg; Pkg.test()'","category":"page"},{"location":"getting-started/julia/#Quick-environment-switching","page":"Julia","title":"Quick environment switching","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"julia> using TestEnv\njulia> TestEnv.activate()    # Switch to test environment with package available","category":"page"},{"location":"getting-started/julia/#Common-issues-and-solutions","page":"Julia","title":"Common issues and solutions","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Package not found:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"julia> ]\npkg> activate .        # Ensure correct environment\npkg> instantiate       # Install missing dependencies","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Changes not reflecting:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Ensure Revise is loaded in startup.jl\nOr restart Julia and reload your package","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Environment conflicts:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"julia> ]\npkg> resolve    # Resolve version conflicts\npkg> update     # Update to compatible versions","category":"page"},{"location":"getting-started/julia/#Next-Steps","page":"Julia","title":"Next Steps","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"With this setup, you're ready to:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Work through the tutorials to learn CensoredDistributions.jl\nExplore the API documentation\nContribute to the project if you're interested","category":"page"},{"location":"getting-started/julia/#Additional-Resources","page":"Julia","title":"Additional Resources","text":"","category":"section"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Community & Help:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Julia Discourse - main community forum\nJulia Slack - real-time chat\nJuliaCon - annual conference with excellent talks","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"Package Development:","category":"page"},{"location":"getting-started/julia/","page":"Julia","title":"Julia","text":"PkgTemplates.jl - package templates with best practices\nJulia Performance Tips - optimization guide\nJuliaHub - discover packages and documentation","category":"page"},{"location":"lib/public/#Public-Documentation","page":"Public API","title":"Public Documentation","text":"","category":"section"},{"location":"lib/public/","page":"Public API","title":"Public API","text":"Documentation for CensoredDistributions.jl's public interface.","category":"page"},{"location":"lib/public/","page":"Public API","title":"Public API","text":"See the Internals section of the manual for internal package docs covering all submodules.","category":"page"},{"location":"lib/public/#Contents","page":"Public API","title":"Contents","text":"","category":"section"},{"location":"lib/public/","page":"Public API","title":"Public API","text":"Pages = [\"public.md\"]\nDepth = 2:2","category":"page"},{"location":"lib/public/#Index","page":"Public API","title":"Index","text":"","category":"section"},{"location":"lib/public/","page":"Public API","title":"Public API","text":"Pages = [\"public.md\"]","category":"page"},{"location":"lib/public/#Public-API","page":"Public API","title":"Public API","text":"","category":"section"},{"location":"lib/public/#CensoredDistributions.AbstractSolverMethod","page":"Public API","title":"CensoredDistributions.AbstractSolverMethod","text":"abstract type AbstractSolverMethod\n\nAbstract type for solver methods used in CDF computation.\n\nSubtypes determine whether analytical solutions are preferred or numerical integration is forced.\n\n\n\nFields\n\n\n\n\n\n","category":"type"},{"location":"lib/public/#CensoredDistributions.AnalyticalSolver","page":"Public API","title":"CensoredDistributions.AnalyticalSolver","text":"struct AnalyticalSolver{S} <: CensoredDistributions.AbstractSolverMethod\n\nSolver that attempts analytical solutions when available, falling back to numerical integration.\n\nStores a numerical integration solver for use when no analytical solution exists for a given distribution pair.\n\n\n\nFields\n\nsolver::Any\n\n\n\n\n\n","category":"type"},{"location":"lib/public/#CensoredDistributions.ExponentiallyTilted","page":"Public API","title":"CensoredDistributions.ExponentiallyTilted","text":"struct ExponentiallyTilted{T<:Real} <: Distributions.Distribution{Distributions.Univariate, Distributions.Continuous}\n\nA continuous distribution on interval [min, max] with exponential tilting controlled by parameter r. This distribution generalises the uniform distribution by allowing exponential weighting of values within the interval.\n\nMathematical Definition\n\nThe probability density function is:\n\nf(x) = fracr exp(r(x - textmin))(exp(r(textmax - textmin)) - 1)\n\nfor x ∈ [min, max] and r ≠ 0.\n\nThe cumulative distribution function is:\n\nF(x) = fracexp(r(x - textmin)) - 1exp(r(textmax - textmin)) - 1\n\nfor x ∈ [min, max].\n\nThe quantile function (inverse CDF) is:\n\nF^-1(p) = textmin +\nfrac1r logleft(1 + p(exp(r(textmax - textmin)) - 1)right)\n\nfor p ∈ [0, 1].\n\nWhen r → 0, all functions reduce to the uniform distribution on [min, max].\n\nFor r > 0: distribution is tilted towards higher values (increasing density)\nFor r < 0: distribution is tilted towards lower values (decreasing density)\n\n\n\nFields\n\nmin::Real: Lower bound of the distribution support.\nmax::Real: Upper bound of the distribution support.\nr::Real: Growth rate parameter (tilting parameter).\n\n\n\n\n\n","category":"type"},{"location":"lib/public/#CensoredDistributions.ExponentiallyTilted-Tuple{Real, Real, Real}","page":"Public API","title":"CensoredDistributions.ExponentiallyTilted","text":"Create an exponentially tilted distribution.\n\nAn exponentially tilted distribution on interval [min, max] with growth rate r. For r > 0, the distribution is tilted towards higher values; for r < 0, towards lower values. When r ≈ 0, it approaches a uniform distribution.\n\nExamples\n\nusing CensoredDistributions, Distributions\n\n# Exponentially increasing distribution\nd1 = ExponentiallyTilted(0.0, 1.0, 2.0)\npdf(d1, 0.5)\n\n# Nearly uniform distribution (small r)\nd3 = ExponentiallyTilted(0.0, 1.0, 1e-10)\nrand(d3, 5)\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.IntervalCensored","page":"Public API","title":"CensoredDistributions.IntervalCensored","text":"struct IntervalCensored{D<:(Distributions.UnivariateDistribution), T} <: Distributions.UnivariateDistribution{Distributions.ValueSupport}\n\nInterval-censored distribution where continuous values are observed only within intervals.\n\nSupports both:\n\nRegular intervals: fixed-width intervals (e.g., daily reporting)\nArbitrary intervals: custom interval boundaries\n\n\n\nFields\n\ndist::Distributions.UnivariateDistribution: The underlying continuous distribution\nboundaries::Any: Either a scalar (regular intervals) or vector (boundaries for arbitrary intervals)\n\n\n\n\n\n","category":"type"},{"location":"lib/public/#CensoredDistributions.NumericSolver","page":"Public API","title":"CensoredDistributions.NumericSolver","text":"struct NumericSolver{S} <: CensoredDistributions.AbstractSolverMethod\n\nSolver that always uses numerical integration.\n\nForces numerical computation even when analytical solutions are available, useful for testing and validation.\n\nThe solver field contains the numerical integration solver to use.\n\n\n\nFields\n\nsolver::Any\n\n\n\n\n\n","category":"type"},{"location":"lib/public/#CensoredDistributions.PrimaryCensored","page":"Public API","title":"CensoredDistributions.PrimaryCensored","text":"struct PrimaryCensored{D1<:(Distributions.UnivariateDistribution), D2<:(Distributions.UnivariateDistribution), M<:CensoredDistributions.AbstractSolverMethod} <: Distributions.Distribution{Distributions.Univariate, Distributions.Continuous}\n\nRepresents the distribution of observed delays when the primary event time is subject to censoring.\n\nThe dist field contains the delay distribution from primary event to observation. The primary_event field contains the primary event time distribution. The method field determines computation strategy:\n\nAnalyticalSolver: Uses closed-form solutions when available (Gamma, LogNormal, Weibull with Uniform primary), falls back to numeric otherwise\nNumericSolver: Always uses quadrature integration\n\nSee also\n\nprimary_censored: Constructor function\nprimarycensored_cdf: CDF computation with method dispatch\n\n\n\nFields\n\ndist::Distributions.UnivariateDistribution: The delay distribution from primary event to observation.\nprimary_event::Distributions.UnivariateDistribution: The primary event time distribution.\nmethod::CensoredDistributions.AbstractSolverMethod: The solver method for CDF computation.\n\n\n\n\n\n","category":"type"},{"location":"lib/public/#CensoredDistributions.Weighted","page":"Public API","title":"CensoredDistributions.Weighted","text":"struct Weighted{D<:(Distributions.UnivariateDistribution), T<:Union{Missing, Real}} <: Distributions.UnivariateDistribution{Distributions.ValueSupport}\n\nA distribution wrapper that applies a weight to the log-probability of an underlying distribution. This is primarily used where observations have associated counts or weights.\n\nOnly the logpdf method is affected by the weight - all other methods (pdf, cdf, sampling, etc.) delegate directly to the underlying distribution.\n\nWeight Types Supported\n\nThe Weighted struct supports three different weight scenarios:\n\nReal weights: Constructor weight is a specific value (e.g., 2.5)\nMissing weights: Constructor weight is missing, allowing weights to be provided at observation time via joint observations (value = x, weight = w)\nZero weights: Handled specially to return -Inf and avoid NaN from 0 * -Inf\n\nExamples\n\nusing CensoredDistributions, Distributions\n\n# Single weighted observation\nd = LogNormal(1.5, 0.5)\nwd = weight(d, 10.0)  # Observation with weight/count of 10\n\n# Weighted log-probability calculation\nobserved_value = 2.0\nweighted_logpdf = logpdf(wd, observed_value)\n\n# Compare with manual calculation\nmanual_logpdf = 10.0 * logpdf(d, observed_value)\n# weighted_logpdf ≈ manual_logpdf\n\n\n\nFields\n\ndist::Distributions.UnivariateDistribution: The underlying distribution being weighted.\nweight::Union{Missing, Real}: The weight to apply to log-probabilities.\n\n\n\n\n\n","category":"type"},{"location":"lib/public/#CensoredDistributions.double_interval_censored-Tuple{Distributions.UnivariateDistribution}","page":"Public API","title":"CensoredDistributions.double_interval_censored","text":"double_interval_censored(\n    dist::Distributions.UnivariateDistribution;\n    primary_event,\n    lower,\n    upper,\n    interval,\n    force_numeric\n) -> Union{CensoredDistributions.PrimaryCensored{D1, Distributions.Uniform{Float64}, CensoredDistributions.AnalyticalSolver{Integrals.QuadGKJL{typeof(LinearAlgebra.norm), Nothing}}} where D1<:(Distributions.UnivariateDistribution), CensoredDistributions.PrimaryCensored{D1, Distributions.Uniform{Float64}, CensoredDistributions.NumericSolver{Integrals.QuadGKJL{typeof(LinearAlgebra.norm), Nothing}}} where D1<:(Distributions.UnivariateDistribution)}\n\n\nCreate a distribution that combines primary interval censoring, optional truncation, and optional secondary interval censoring in the correct order.\n\nThis is a convenience function that applies the following transformations in sequence:\n\nPrimary event censoring using primary_censored(dist, primary_event)\nTruncation using truncated(dist; lower=lower, upper=upper) (if bounds are provided)\nSecondary interval censoring using interval_censored(dist, interval) (if interval is provided)\n\nThe order of operations ensures mathematical correctness, particularly that truncation occurs before secondary interval censoring.\n\nArguments\n\ndist: The delay distribution from primary event to observation\n\nKeyword Arguments\n\nprimary_event: The primary event time distribution. Defaults to uniform distribution over [0, 1].\nlower: Lower truncation bound. If nothing, no lower truncation is applied.\nupper: Upper truncation bound (e.g., observation time D). If nothing, no upper truncation is applied.\ninterval: Secondary censoring interval width (e.g., daily reporting). If nothing, no interval censoring is applied.\nforce_numeric: Force numerical integration for primary censoring even when analytical solutions exist.\n\nReturns\n\nA composed distribution that can be used with all standard Distributions.jl methods (rand, pdf, cdf, etc.).\n\nExamples\n\nusing CensoredDistributions, Distributions\n\n# Basic primary censoring only (uses default Uniform(0, 1))\ndist1 = double_interval_censored(LogNormal(1.5, 0.75))\n\n# Primary censoring + truncation\ndist2 = double_interval_censored(LogNormal(1.5, 0.75); upper=10)\n\n# Primary censoring + secondary interval censoring\ndist3 = double_interval_censored(LogNormal(1.5, 0.75); interval=1)\n\n# Full double interval censoring with truncation\ndist4 = double_interval_censored(LogNormal(1.5, 0.75); upper=10, interval=1)\n\n# Evaluate distribution functions and compute statistics\npdf_at_3 = pdf(dist4, 3.0)        # probability density at 3 days\ncdf_at_7 = cdf(dist4, 7.0)        # P(X ≤ 7) with full censoring pipeline\nccdf_at_5 = ccdf(dist4, 5.0)      # survival function\nq25 = quantile(dist4, 0.25)       # 25th percentile\nmedian_delay = quantile(dist4, 0.5)  # median\nq95 = quantile(dist4, 0.95)       # 95th percentile\nsamples = rand(dist4, 100)        # random samples\n\n# Custom primary event distribution\ndist5 = double_interval_censored(LogNormal(1.5, 0.75); primary_event=Uniform(0, 2))\n\nMathematical Background\n\nThis function implements the complete workflow for handling censored delay distributions as described in Park et al. (2024) and Charniga et al. (2024):\n\nPrimary censoring: Accounts for uncertainty in the primary event timing\nTruncation: Handles observation windows and finite study periods\nSecondary censoring: Models interval censoring effects (e.g., daily reporting)\n\nReferences\n\nPark et al. (2024): \"Estimating epidemiological delay distributions for infectious diseases\"\nCharniga et al. (2024): \"Best practices for estimating and reporting epidemiological delay distributions\"\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.get_dist-Tuple{Any}","page":"Public API","title":"CensoredDistributions.get_dist","text":"get_dist(d) -> Distributions.UnivariateDistribution\n\n\nExtract the underlying distribution from a wrapped distribution type.\n\nThis utility function provides a consistent interface for extracting the core distribution from various wrapper types in the CensoredDistributions ecosystem. For unwrapped distributions, it returns the distribution unchanged.\n\nArguments\n\nd: A distribution or wrapped distribution\n\nReturns\n\nThe underlying distribution. For base distributions, returns d unchanged.\n\nExamples\n\nusing CensoredDistributions, Distributions\n\n# Base distribution - returns unchanged\nd1 = Normal(0, 1)\nget_dist(d1) == d1  # true\n\n# Primary censored distribution\ndelay = LogNormal(1.5, 0.75)\nwindow = Uniform(0, 1)\npc = primary_censored(delay, window)\nget_dist(pc) == delay  # true\n\n# Interval censored distribution\ncontinuous = Normal(5, 2)\nic = interval_censored(continuous, 1.0)\nget_dist(ic) == continuous  # true\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.get_dist-Tuple{CensoredDistributions.IntervalCensored}","page":"Public API","title":"CensoredDistributions.get_dist","text":"get_dist(\n    d::CensoredDistributions.IntervalCensored\n) -> Distributions.UnivariateDistribution\n\n\nExtract the underlying continuous distribution from an interval censored distribution.\n\nReturns the continuous distribution that was discretised into intervals.\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.get_dist-Tuple{CensoredDistributions.PrimaryCensored}","page":"Public API","title":"CensoredDistributions.get_dist","text":"get_dist(\n    d::CensoredDistributions.PrimaryCensored\n) -> Distributions.UnivariateDistribution\n\n\nExtract the delay distribution from a primary censored distribution.\n\nReturns the underlying delay distribution (the distribution of times from primary event to observation).\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.get_dist-Tuple{CensoredDistributions.Weighted}","page":"Public API","title":"CensoredDistributions.get_dist","text":"get_dist(\n    d::CensoredDistributions.Weighted\n) -> Distributions.UnivariateDistribution\n\n\nExtract the underlying distribution from a weighted distribution.\n\nReturns the base distribution before weighting was applied.\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.get_dist-Tuple{Distributions.Censored}","page":"Public API","title":"CensoredDistributions.get_dist","text":"get_dist(\n    d::Distributions.Censored\n) -> Distributions.UnivariateDistribution\n\n\nExtract the underlying distribution from a censored distribution.\n\nReturns the uncensored distribution before censoring bounds were applied. This method supports the Censored type from Distributions.jl created by the censored() function.\n\nExamples\n\nusing Distributions\n\n# Extract Normal from censored Normal\nbase = Normal(0, 1)\ncensored_dist = censored(base, -2, 2)\nget_dist(censored_dist) === base  # true\n\n# Works with any censored distribution\ngamma_base = Gamma(2, 1)\ncensored_gamma = censored(gamma_base, 0.1, 5.0)\nget_dist(censored_gamma) === gamma_base  # true\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.get_dist-Tuple{Distributions.Product}","page":"Public API","title":"CensoredDistributions.get_dist","text":"get_dist(\n    d::Distributions.Product\n) -> AbstractVector{T} where {S<:Distributions.ValueSupport, T<:Distributions.UnivariateDistribution{S}}\n\n\nExtract the component distributions from a product distribution.\n\nReturns a vector containing the underlying distributions for each component of the product distribution. This is useful when working with vectorised distributions or multiple independent observations.\n\nNote\n\nThis method has different behaviour from other get_dist methods as it returns a vector of distributions rather than a single distribution.\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.get_dist-Tuple{Distributions.Truncated}","page":"Public API","title":"CensoredDistributions.get_dist","text":"get_dist(\n    d::Distributions.Truncated\n) -> Distributions.UnivariateDistribution\n\n\nExtract the untruncated distribution from a truncated distribution.\n\nReturns the underlying continuous distribution before truncation bounds were applied.\n\nExamples\n\nusing Distributions\n\n# Extract Normal from truncated Normal\nbase = Normal(0, 1)\ntrunc_dist = truncated(base, -2, 2)\nget_dist(trunc_dist) === base  # true\n\n# Works with any truncated distribution\ngamma_base = Gamma(2, 1)\ntrunc_gamma = truncated(gamma_base, 0.1, 5.0)\nget_dist(trunc_gamma) === gamma_base  # true\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.get_dist_recursive-Tuple{Any}","page":"Public API","title":"CensoredDistributions.get_dist_recursive","text":"get_dist_recursive(d) -> Any\n\n\nRecursively extract the underlying distribution from nested wrapper types.\n\nThis function keeps applying get_dist until it reaches a distribution that doesn't have a specialised method, meaning no further unwrapping is possible. This is useful for deeply nested distributions like IntervalCensored{Truncated{PrimaryCensored{...}}}.\n\nArguments\n\nd: A distribution or nested wrapped distribution\n\nReturns\n\nThe deeply underlying distribution after all unwrapping is complete.\n\nExamples\n\nusing CensoredDistributions, Distributions\n\n# Single wrapper - same as get_dist\ndelay = LogNormal(1.5, 0.75)\nwindow = Uniform(0, 1)\npc = primary_censored(delay, window)\nget_dist_recursive(pc) == delay  # true\n\n# Nested wrappers\ncontinuous = Normal(5, 2)\nic = interval_censored(continuous, 1.0)\nweighted = weight(ic, 2.0)\nget_dist_recursive(weighted) == continuous  # true\n\n# Truncated nested wrappers\nbase = Normal(0, 1)\ntrunc_dist = truncated(base, -2, 2)\nweighted_trunc = weight(trunc_dist, 2.0)\nget_dist_recursive(weighted_trunc) == base  # true\n\n# Censored nested wrappers\ncensored_dist = censored(Normal(0, 1), -2, 2)\nweighted_censored = weight(censored_dist, 2.0)\nget_dist_recursive(weighted_censored) == base  # true\n\n# Double interval censored distributions (fully recursive)\ndelay = LogNormal(1.5, 0.75)\nfull_double = double_interval_censored(delay; upper=10, interval=1)\nget_dist_recursive(full_double) == delay  # true\n\n# Weighted double interval censored\nweighted_double = weight(full_double, 2.0)\nget_dist_recursive(weighted_double) == delay  # true\n\n# Base distribution - returns unchanged\nd = Normal(0, 1)\nget_dist_recursive(d) == d  # true\n\nNote\n\nFor Product distributions, this function applies recursive extraction to each component, potentially returning mixed types of underlying distributions.\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.interval_censored-Tuple{Distributions.UnivariateDistribution, AbstractVector{<:Real}}","page":"Public API","title":"CensoredDistributions.interval_censored","text":"interval_censored(\n    dist::Distributions.UnivariateDistribution,\n    boundaries::AbstractVector{<:Real}\n) -> CensoredDistributions.IntervalCensored{D, <:AbstractVector{var\"#s11\"}} where {D<:(Distributions.UnivariateDistribution), var\"#s11\"<:Real}\n\n\nConstruct an interval-censored distribution with arbitrary intervals.\n\nCreates a distribution where observations are censored to specified intervals defined by the boundaries. For example, with boundaries=[0, 2, 5, 10], observations fall into [0,2), [2,5), or [5,10).\n\nArguments\n\ndist: The underlying continuous distribution\nboundaries: Vector of interval boundaries (must be sorted and strictly increasing, minimum length 2)\n\nExamples\n\nusing CensoredDistributions, Distributions\n\n# Age groups: 0-18, 18-65, 65+\nage_dist = interval_censored(Normal(40, 20), [0, 18, 65, 100])\nq75 = quantile(age_dist, 0.75)     # 75th percentile (boundary value)\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.interval_censored-Tuple{Distributions.UnivariateDistribution, Real}","page":"Public API","title":"CensoredDistributions.interval_censored","text":"interval_censored(\n    dist::Distributions.UnivariateDistribution,\n    interval::Real\n) -> CensoredDistributions.IntervalCensored{D, <:Real} where D<:(Distributions.UnivariateDistribution)\n\n\nConstruct an interval-censored distribution with regular intervals.\n\nCreates a distribution where observations are censored to regular intervals of width interval, starting from 0. For example, with interval=1, observations fall into [0,1), [1,2), [2,3), etc.\n\nArguments\n\ndist: The underlying continuous distribution\ninterval: Width of regular intervals (must be positive)\n\nExamples\n\nusing CensoredDistributions, Distributions\n\n# Daily reporting intervals\nd = interval_censored(Normal(5, 2), 1.0)\n\n# Evaluate distribution functions\npdf_at_5 = pdf(d, 5.0)      # probability mass at interval containing 5\nq25 = quantile(d, 0.25)     # 25th percentile (interval boundary)\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.primary_censored-Tuple{Distributions.UnivariateDistribution, Distributions.UnivariateDistribution}","page":"Public API","title":"CensoredDistributions.primary_censored","text":"primary_censored(\n    dist::Distributions.UnivariateDistribution,\n    primary_event::Distributions.UnivariateDistribution;\n    solver,\n    force_numeric\n) -> Union{CensoredDistributions.PrimaryCensored{D1, D2, CensoredDistributions.AnalyticalSolver{Integrals.QuadGKJL{typeof(LinearAlgebra.norm), Nothing}}} where {D1<:(Distributions.UnivariateDistribution), D2<:(Distributions.UnivariateDistribution)}, CensoredDistributions.PrimaryCensored{D1, D2, CensoredDistributions.NumericSolver{Integrals.QuadGKJL{typeof(LinearAlgebra.norm), Nothing}}} where {D1<:(Distributions.UnivariateDistribution), D2<:(Distributions.UnivariateDistribution)}}\n\n\nCreate a primary event censored distribution.\n\nModels a process where a primary event occurs within a censoring window, followed by a delay. The primary event time is not observed directly but is known to fall within the censoring distribution's support. The observed time is the sum of the primary event time and the delay.\n\nMethod Selection\n\nThe CDF computation is handled by primarycensored_cdf which automatically dispatches between:\n\nAnalytical methods: Available for these distribution pairs with Uniform primary events when force_numeric=false:\nGamma delay distribution\nLogNormal delay distribution\nWeibull delay distribution\nNumeric integration: Falls back to quadrature for all other distribution pairs or when force_numeric=true\n\nSet force_numeric=true to always use numeric integration, which may be necessary for certain AD backends or when debugging.\n\nArguments\n\ndist: The delay distribution from primary event to observation\nprimary_event: The distribution of primary event times within the window\n\nKeyword Arguments\n\nsolver: Quadrature solver (default: QuadGKJL())\nforce_numeric: Force numeric integration even when analytical available (default: false)\n\nThis is useful for modeling:\n\nInfection-to-symptom onset times when infection time is uncertain\nExposure-to-outcome delays with uncertain exposure timing\nAny process where the initiating event time has uncertainty\n\nExamples\n\nusing CensoredDistributions, Distributions\n\n# Incubation period (delay) with uncertain infection time (primary event)\nincubation = LogNormal(1.5, 0.75)  # Delay distribution\ninfection_window = Uniform(0, 1)    # Daily infection window\nd = primary_censored(incubation, infection_window)\n\n# Evaluate distribution functions\npdf_at_2 = pdf(d, 2.0)    # probability density at 2 days\ncdf_at_5 = cdf(d, 5.0)    # cumulative probability by 5 days\nq50 = quantile(d, 0.5)    # median\n\n# Force numeric integration for debugging or AD compatibility\nd_numeric = primary_censored(incubation, infection_window; force_numeric=true)\n\nSee also\n\nprimarycensored_cdf: The underlying CDF computation with method dispatch\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.primary_censored-Tuple{Distributions.UnivariateDistribution}","page":"Public API","title":"CensoredDistributions.primary_censored","text":"primary_censored(\n    dist::Distributions.UnivariateDistribution;\n    primary_event,\n    solver,\n    force_numeric\n) -> Union{CensoredDistributions.PrimaryCensored{D1, Distributions.Uniform{Float64}, CensoredDistributions.AnalyticalSolver{Integrals.QuadGKJL{typeof(LinearAlgebra.norm), Nothing}}} where D1<:(Distributions.UnivariateDistribution), CensoredDistributions.PrimaryCensored{D1, Distributions.Uniform{Float64}, CensoredDistributions.NumericSolver{Integrals.QuadGKJL{typeof(LinearAlgebra.norm), Nothing}}} where D1<:(Distributions.UnivariateDistribution)}\n\n\nCreate a primary event censored distribution with keyword arguments.\n\nThis is a convenience version of primary_censored that uses keyword arguments for consistency with double_interval_censored. The primary event distribution defaults to Uniform(0, 1).\n\nExamples\n\nusing CensoredDistributions, Distributions\n\n# Using default Uniform(0, 1) primary event\nd1 = primary_censored(LogNormal(1.5, 0.75))\n\n# Custom primary event distribution\nd2 = primary_censored(LogNormal(1.5, 0.75); primary_event=Uniform(0, 2))\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.primarycensored_cdf-Tuple{Distributions.Gamma, Distributions.Uniform, Real, CensoredDistributions.AnalyticalSolver}","page":"Public API","title":"CensoredDistributions.primarycensored_cdf","text":"primarycensored_cdf(\n    dist::Distributions.Gamma,\n    primary_event::Distributions.Uniform,\n    x::Real,\n    _::CensoredDistributions.AnalyticalSolver\n) -> Any\n\n\nAnalytical CDF for Gamma delay with Uniform primary event distribution.\n\nImplements the closed-form solution derived in Park et al. (2024) and originally in Cori et al. (2013). Uses the partial expectation of the Gamma distribution to avoid numerical integration.\n\nThe formula involves CDFs of Gamma distributions with shape parameters k and k+1, computed in log-space for numerical stability.\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.primarycensored_cdf-Tuple{Distributions.LogNormal, Distributions.Uniform, Real, CensoredDistributions.AnalyticalSolver}","page":"Public API","title":"CensoredDistributions.primarycensored_cdf","text":"primarycensored_cdf(\n    dist::Distributions.LogNormal,\n    primary_event::Distributions.Uniform,\n    x::Real,\n    _::CensoredDistributions.AnalyticalSolver\n) -> Any\n\n\nAnalytical CDF for LogNormal delay with Uniform primary event distribution.\n\nUses a parameter shift approach where the partial expectation of LogNormal(μ, σ) can be expressed using the CDF of LogNormal(μ + σ², σ).\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.primarycensored_cdf-Tuple{Distributions.Weibull, Distributions.Uniform, Real, CensoredDistributions.AnalyticalSolver}","page":"Public API","title":"CensoredDistributions.primarycensored_cdf","text":"primarycensored_cdf(\n    dist::Distributions.Weibull,\n    primary_event::Distributions.Uniform,\n    x::Real,\n    _::CensoredDistributions.AnalyticalSolver\n) -> Any\n\n\nAnalytical CDF for Weibull delay with Uniform primary event distribution.\n\nUses the lower incomplete gamma function to express the partial expectation of the Weibull distribution analytically.\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.primarycensored_cdf-Union{Tuple{D2}, Tuple{D1}, Tuple{D1, D2, Real, CensoredDistributions.AbstractSolverMethod}} where {D1<:(Distributions.UnivariateDistribution), D2<:(Distributions.UnivariateDistribution)}","page":"Public API","title":"CensoredDistributions.primarycensored_cdf","text":"primarycensored_cdf(\n    dist::Distributions.UnivariateDistribution,\n    primary_event::Distributions.UnivariateDistribution,\n    x::Real,\n    method::CensoredDistributions.AbstractSolverMethod\n) -> Any\n\n\nCompute the CDF of a primary event censored distribution.\n\nDispatches to either analytical or numerical implementation based on the solver method. Analytical solutions are available for specific distribution pairs with Uniform primary events. Use methods(primarycensored_cdf) to see all available analytical implementations.\n\nFor distribution pairs without analytical solutions, numerical integration is used automatically when called with an AnalyticalSolver. Use NumericSolver to force numerical integration even when analytical solutions exist (useful for testing and validation).\n\nArguments\n\ndist: The delay distribution from primary event to observation\nprimary_event: The primary event time distribution\nx: Evaluation point for the CDF\nmethod: Solver method (AnalyticalSolver or NumericSolver)\n\nReturns\n\nThe cumulative probability P(X ≤ x) where X is the observed delay time.\n\nExamples\n\nusing CensoredDistributions, Distributions, Integrals\n\n# Analytical solution for Gamma with Uniform primary event\ngamma_dist = Gamma(2.0, 1.5)\nprimary_uniform = Uniform(0, 2)\nanalytical_method = AnalyticalSolver(QuadGKJL())\n\ncdf_val = primarycensored_cdf(gamma_dist, primary_uniform, 3.0, analytical_method)\n\n# Force numerical integration\nnumeric_method = NumericSolver(QuadGKJL())\ncdf_numeric = primarycensored_cdf(gamma_dist, primary_uniform, 3.0, numeric_method)\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.primarycensored_cdf-Union{Tuple{D2}, Tuple{D1}, Tuple{D1, D2, Real, CensoredDistributions.AnalyticalSolver}} where {D1<:(Distributions.UnivariateDistribution), D2<:(Distributions.UnivariateDistribution)}","page":"Public API","title":"CensoredDistributions.primarycensored_cdf","text":"primarycensored_cdf(\n    dist::Distributions.UnivariateDistribution,\n    primary_event::Distributions.UnivariateDistribution,\n    x::Real,\n    method::CensoredDistributions.AnalyticalSolver\n) -> Any\n\n\nGeneric fallback implementation for AnalyticalSolver.\n\nWhen no specific analytical solution is available for a distribution pair, this method falls back to numerical integration using the solver stored in the AnalyticalSolver.\n\nSpecific analytical implementations exist for:\n\nGamma delay with Uniform primary event\nLogNormal delay with Uniform primary event\nWeibull delay with Uniform primary event\n\nFor all other distribution pairs, numerical integration is used automatically.\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.primarycensored_cdf-Union{Tuple{D2}, Tuple{D1}, Tuple{D1, D2, Real, CensoredDistributions.NumericSolver}} where {D1<:(Distributions.UnivariateDistribution), D2<:(Distributions.UnivariateDistribution)}","page":"Public API","title":"CensoredDistributions.primarycensored_cdf","text":"primarycensored_cdf(\n    dist::Distributions.UnivariateDistribution,\n    primary_event::Distributions.UnivariateDistribution,\n    x::Real,\n    method::CensoredDistributions.NumericSolver\n) -> Any\n\n\nNumerical CDF implementation for primary event censored distributions.\n\nComputes the CDF using numerical integration when no analytical solution is available. The integral computed is:\n\nF_S+(x) = int_max(x-u_max s_min)^x-u_min F_S(u) f_U(x-u) du\n\nwhere FS is the delay distribution CDF, fU is the primary event distribution PDF, umin and umax are the primary event bounds, and s_min is the delay minimum.\n\nHandles edge cases and uses the solver stored in the NumericSolver method.\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.primarycensored_logcdf-Union{Tuple{D2}, Tuple{D1}, Tuple{D1, D2, Real, CensoredDistributions.AbstractSolverMethod}} where {D1<:(Distributions.UnivariateDistribution), D2<:(Distributions.UnivariateDistribution)}","page":"Public API","title":"CensoredDistributions.primarycensored_logcdf","text":"primarycensored_logcdf(\n    dist::Distributions.UnivariateDistribution,\n    primary_event::Distributions.UnivariateDistribution,\n    x::Real,\n    method::CensoredDistributions.AbstractSolverMethod\n) -> Any\n\n\nCompute the log CDF of a primary event censored distribution.\n\nDispatches to either analytical or numerical implementation based on the solver method. Computes log(CDF) with appropriate handling for edge cases where CDF = 0. Returns -Inf when the probability is zero or when numerical issues occur.\n\nArguments\n\ndist: The delay distribution from primary event to observation\nprimary_event: The primary event time distribution\nx: Evaluation point for the log CDF\nmethod: Solver method (AnalyticalSolver or NumericSolver)\n\nExamples\n\nusing CensoredDistributions, Distributions\n\n# Create a Gamma delay with uniform primary event\ndist = Gamma(2.0, 1.5)\nprimary_event = Uniform(0.0, 3.0)\nmethod = AnalyticalSolver(nothing)\n\n# Compute log CDF at x = 5.0\nlog_prob = primarycensored_logcdf(dist, primary_event, 5.0, method)\n\nSee also\n\nprimarycensored_cdf: The underlying CDF computation\ncdf: Interface method for PrimaryCensored distributions\nlogcdf: Interface method for PrimaryCensored distributions\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.weight-Tuple{AbstractVector{<:Distributions.UnivariateDistribution}, AbstractVector{<:Real}}","page":"Public API","title":"CensoredDistributions.weight","text":"weight(\n    dists::AbstractVector{<:Distributions.UnivariateDistribution},\n    weights::AbstractVector{<:Real}\n) -> Any\n\n\nCreate a product distribution of weighted distributions, where each distribution has its own weight.\n\nA Product distribution of Weighted distributions suitable for vectorized observations with different distributions.\n\nExamples\n\nusing CensoredDistributions, Distributions\n\ny_obs = [3.5, 4.2, 3.8]  # Observed values\ndists = [Normal(2.0, 0.5), Normal(2.5, 0.8), Normal(1.8, 0.6)]\nn_counts = [25, 10, 15]  # Counts for each observation\nweighted_dists = weight(dists, n_counts)\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.weight-Tuple{AbstractVector{<:Distributions.UnivariateDistribution}}","page":"Public API","title":"CensoredDistributions.weight","text":"weight(\n    dists::AbstractVector{<:Distributions.UnivariateDistribution}\n) -> Any\n\n\nCreate a product distribution of weighted distributions with missing constructor weights.\n\nUseful for creating distributions where weights will be provided at observation time. Each distribution uses missing as constructor weight, enabling observation weight to be used directly.\n\nExamples\n\nusing CensoredDistributions, Distributions\n\ny_obs = [3.5, 4.2, 3.8]  # Observed values\ndists = [Normal(2.0, 0.5), Normal(2.5, 0.8), Normal(1.8, 0.6)]\n\n# Create weighted distributions with missing constructor weights\nweighted_dists = weight(dists)\n\n# Weights provided at observation time via joint observations\nlogpdf(weighted_dists, (values = y_obs, weights = [25, 10, 15]))\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.weight-Tuple{Distributions.UnivariateDistribution, AbstractVector{<:Real}}","page":"Public API","title":"CensoredDistributions.weight","text":"weight(\n    dist::Distributions.UnivariateDistribution,\n    weights::AbstractVector{<:Real}\n) -> Any\n\n\nCreate a product distribution of weighted distributions, each with a different weight.\n\nA Product distribution of Weighted distributions suitable for vectorized observations.\n\nArguments\n\ndist: The univariate distribution to be replicated and weighted for each observation\nweights: Vector of weights to apply to each copy of the distribution\n\nExamples\n\ny_obs = [3.5, 4.2, 3.8]  # Observed values\nn_counts = [25, 10, 15]  # Counts for each observation\n\nd = Normal(2.0, 1.0)\nweighted_dists = weight(d, n_counts)\n\n# Weighted log-probability calculation\nweighted_logpdf = logpdf(weighted_dists, y_obs)\n# equivalent to: sum(n_counts .* logpdf.(d, y_obs))\n\nSee also\n\nWeighted: The underlying weighted distribution type\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.weight-Tuple{Distributions.UnivariateDistribution, Real}","page":"Public API","title":"CensoredDistributions.weight","text":"weight(\n    dist::Distributions.UnivariateDistribution,\n    w::Real\n) -> CensoredDistributions.Weighted{D, T} where {D<:(Distributions.UnivariateDistribution), T<:Real}\n\n\nCreate a weighted distribution where the log-probability is scaled by w.\n\nA Weighted distribution will contribute w * logpdf(dist, x) to the log-probability when evaluating logpdf(weighted_dist, x).\n\nExamples\n\n# For aggregated count data\ny_obs = 3.5  # Observed value\nn_count = 25  # Number of times this value was observed\n\nd = Normal(2.0, 1.0)\nweighted_d = weight(d, n_count)\n\n# Weighted log-probability calculation\nweighted_logpdf = logpdf(weighted_d, y_obs)\n# equivalent to: n_count * logpdf(d, y_obs)\n\n\n\n\n\n","category":"method"},{"location":"lib/public/#CensoredDistributions.weight-Tuple{Distributions.UnivariateDistribution}","page":"Public API","title":"CensoredDistributions.weight","text":"weight(\n    dist::Distributions.UnivariateDistribution\n) -> CensoredDistributions.Weighted{D, Missing} where D<:(Distributions.UnivariateDistribution)\n\n\nCreate a weighted distribution with missing constructor weight.\n\nUseful for creating distributions where weights will be provided at observation time. Uses missing as constructor weight, enabling observation weight to be used directly.\n\nExamples\n\nusing CensoredDistributions, Distributions\n\nd = Normal(2.0, 0.5)\n\n# Create weighted distribution with missing constructor weight\nweighted_dist = weight(d)\n\n# Weight provided at observation time via joint observations\nlogpdf(weighted_dist, (value = 3.5, weight = 25))\n\n\n\n\n\n","category":"method"},{"location":"developer/#developer","page":"Overview","title":"Developer Documentation","text":"","category":"section"},{"location":"developer/","page":"Overview","title":"Overview","text":"Welcome to the CensoredDistributions.jl developer documentation. This section contains guides and resources for contributors and maintainers.","category":"page"},{"location":"developer/#Contributing-to-CensoredDistributions.jl","page":"Overview","title":"Contributing to CensoredDistributions.jl","text":"","category":"section"},{"location":"developer/","page":"Overview","title":"Overview","text":"New to contributing? Start here:","category":"page"},{"location":"developer/","page":"Overview","title":"Overview","text":"Contributing Guide: How to contribute code, documentation, and issues\nRelease Process: How we manage releases and versioning","category":"page"},{"location":"developer/","page":"Overview","title":"Overview","text":"For general Julia development setup, see Getting Started with Julia in the Getting Started section.","category":"page"},{"location":"developer/#Frequently-Asked-Questions","page":"Overview","title":"Frequently Asked Questions","text":"","category":"section"},{"location":"developer/#How-do-I-run-tests-faster-during-development?","page":"Overview","title":"How do I run tests faster during development?","text":"","category":"section"},{"location":"developer/","page":"Overview","title":"Overview","text":"You can skip the quality tests (which include Aqua.jl, DocTest, and other checks) by using:","category":"page"},{"location":"developer/","page":"Overview","title":"Overview","text":"julia --project=test test/runtests.jl skip_quality","category":"page"},{"location":"developer/","page":"Overview","title":"Overview","text":"This is useful during active development when you want quick feedback on your changes without waiting for the full quality suite.","category":"page"},{"location":"developer/","page":"Overview","title":"Overview","text":"","category":"page"},{"location":"developer/","page":"Overview","title":"Overview","text":"For users looking to get started with the package, see the Getting Started section.","category":"page"},{"location":"getting-started/tutorials/fitting-with-turing/","page":"Fitting with Turing.jl","title":"Fitting with Turing.jl","text":"<style>\n    #documenter-page table {\n        display: table !important;\n        margin: 2rem auto !important;\n        border-top: 2pt solid rgba(0,0,0,0.2);\n        border-bottom: 2pt solid rgba(0,0,0,0.2);\n    }\n\n    #documenter-page pre, #documenter-page div {\n        margin-top: 1.4rem !important;\n        margin-bottom: 1.4rem !important;\n    }\n\n    .code-output {\n        padding: 0.7rem 0.5rem !important;\n    }\n\n    .admonition-body {\n        padding: 0em 1.25em !important;\n    }\n</style>\n\n<!-- PlutoStaticHTML.Begin -->\n<!--\n    # This information is used for caching.\n    [PlutoStaticHTML.State]\n    input_sha = \"dfeab1d30defa083839342c35b0fccdd9ad8142362185e0651296508e9ee1900\"\n    julia_version = \"1.11.7\"\n-->\n\n\n\n\n<div class=\"markdown\"><h1 id=\"Fitting-CensoredDistributions.jl-modified-distributions-with-Turing.jl\">Fitting CensoredDistributions.jl modified distributions with Turing.jl</h1><h2 id=\"Introduction\">Introduction</h2><h3 id=\"What-are-we-going-to-do-in-this-exercise\">What are we going to do in this exercise</h3><p>We'll demonstrate how to use <code>CensoredDistributions.jl</code> in conjunction with Turing.jl for Bayesian inference of epidemiological delay distributions. We'll cover the following key points:</p><ol><li><p>Defining a simple delay distribution model without observation processes.</p></li><li><p>Exploring the prior distribution of this model.</p></li><li><p>Defining a Bayesian model that incorporates double censoring and right truncation</p></li><li><p>Generating synthetic data from the model using fixed parameters</p></li><li><p>Fitting a naive model that ignores censoring</p></li><li><p>Fitting a model that accounts for secondary event censoring and truncation but not primary event censoring.</p></li><li><p>Fitting the full model that accounts for double censoring and right truncation.</p></li><li><p>Using improved weight conditioning with joint observations and fix() patterns</p></li><li><p>Demonstrating StatsBase.AbstractWeights integration patterns</p></li></ol><h2 id=\"What-might-I-need-to-know-before-starting\">What might I need to know before starting</h2><p>This tutorial builds on the concepts introduced in <a href=\"@ getting-started\">Getting Started with CensoredDistributions.jl</a>.</p><h2 id=\"Packages-used\">Packages used</h2><p>We use CairoMakie for plotting, Turing for probabilistic programming, Chain.jl for data pipeline workflows, DataFramesMeta, Random, and StatsBase.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    using DataFramesMeta\n    using Turing\n    using DynamicPPL\n    using Distributions\n    using Random\n    using CairoMakie, PairPlots\n    using StatsBase\n    using CensoredDistributions\nend</code></pre>\n\n\n\n<div class=\"markdown\"><h2 id=\"Generate-synthetic-data-using-Turing-model-simulation\">Generate synthetic data using Turing model simulation</h2><p>We'll generate synthetic data by simulating from our Turing model with known true parameters. This approach ensures consistency between the data generation process and the model we'll use for inference, demonstrating how Turing models can be used for both simulation and fitting.</p><p>The proper Turing simulation approach:</p><ol><li><p>Define a Turing model that incorporates double censoring and right truncation</p></li><li><p>Create a model instance with missing observations for simulation</p></li><li><p>Use DynamicPPL's <code>fix</code> function to set parameters to their true values</p></li><li><p>Sample from the prior predictive distribution by calling the model as a function</p></li></ol></div>\n\n\n<div class=\"markdown\"><h3 id=\"Define-the-true-parameters-for-generating-synthetic-data\">Define the true parameters for generating synthetic data</h3></div>\n\n\n<div class=\"markdown\"><p>We start by defining the number of samples and the true parameters of the lognormal.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>n = 2000;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>meanlog = 1.5;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>sdlog = 0.75;</code></pre>\n\n\n\n<div class=\"markdown\"><p>Now we can define a lognormal distribution using Distributions.jl.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>true_dist = LogNormal(meanlog, sdlog);</code></pre>\n\n\n\n<div class=\"markdown\"><p>For each individual we now sample a primary and secondary event window as well as a relative observation time (relative to their censored primary event).</p></div>\n\n\n<div class=\"markdown\"><h3 id=\"Define-a-reusable-submodel-for-the-latent-delay-distribution\">Define a reusable submodel for the latent delay distribution</h3><p>To avoid code duplication across our models, we define a submodel that encapsulates the latent delay distribution parameters. This pattern allows us to reuse the same prior structure across all our models:</p></div>\n\n<pre class='language-julia'><code class='language-julia'>@model function latent_delay_dist()\n    mu ~ Normal(1.0, 2.0);\n    sigma ~ truncated(Normal(0.5, 1); lower = 0.0)\n    return LogNormal(mu, sigma)\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-latent_delay_dist\">latent_delay_dist (generic function with 2 methods)</pre>\n\n\n<div class=\"markdown\"><p>and define a helper function to standardize our pairplot visualizations across all model fits:</p></div>\n\n<pre class='language-julia'><code class='language-julia'>function plot_fit_with_truth(chain, truth_dict)\n    f = pairplot(\n        chain,\n        PairPlots.Truth(\n            truth_dict,\n            label = \"True Values\"\n        )\n    )\n    return f\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-plot_fit_with_truth\">plot_fit_with_truth (generic function with 1 method)</pre>\n\n\n<div class=\"markdown\"><h3 id=\"Prior-predictive-checks-using-pairplot\">Prior predictive checks using pairplot</h3><p>First, let's visualise the prior predictive distribution by sampling from the instantiated model with uninformative priors and comparing against our true parameters. This shows what the model believes before seeing any data.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    Random.seed!(123);\n\n    # Sample from the latent delay distribution prior\n    latent_prior_samples = sample(latent_delay_dist(), Prior(), 1000)\n\n    # Visualize the prior distribution\n    plot_fit_with_truth(latent_prior_samples, (; mu = meanlog, sigma = sdlog))\nend</code></pre>\n<img height=\"429\" src=\"data:image/png;base64, \" style=\"object-fit: contain; height: auto;\" width=\"538\"/>\n\n\n<div class=\"markdown\"><h3 id=\"Define-the-double-censored-model-for-simulation-and-fitting\">Define the double censored model for simulation and fitting</h3><p>Now we define our full model that incorporates double censoring and right truncation. This model uses the <code>latent_delay_dist()</code> submodel via <code>to_submodel()</code> to include the delay distribution parameters. It also uses our <code>double_interval_censored()</code> function to define each double censored and right truncated delay:</p></div>\n\n<pre class='language-julia'><code class='language-julia'>@model function CensoredDistributions_model(pwindow_bounds, swindow_bounds, obs_time_bounds)\n    pwindows ~ arraydist([DiscreteUniform(pw[1], pw[2]) for pw in pwindow_bounds])\n    swindows ~ arraydist([DiscreteUniform(sw[1], sw[2]) for sw in swindow_bounds])\n    obs_times ~ arraydist([DiscreteUniform(ot[1], ot[2]) for ot in obs_time_bounds])\n\n    dist ~ to_submodel(latent_delay_dist())\n\n    pcens_dists = map(pwindows, obs_times, swindows) do pw, D, sw\n        pe = Uniform(0, pw)\n        double_interval_censored(\n            dist; primary_event = pe, upper = D, interval = sw)\n    end\n\n    obs ~ weight(pcens_dists)\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-CensoredDistributions_model\">CensoredDistributions_model (generic function with 2 methods)</pre>\n\n\n<div class=\"markdown\"><p>We also need to define our simulated observation window bounds for each observed delay as well as the bounds on the amount of censored time in which events have been observed (required to adjust for truncation). We will then combine these bounds with the model in order to simulate data.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>bounds_df = DataFrame(\n    pwindow_bounds = fill((1, 3), n),  # Each observation can have pwindow 1-3\n    swindow_bounds = fill((1, 3), n),  # Each observation can have swindow 1-3\n    obs_time_bounds = fill((8, 12), n)  # Each observation can have obs_time 8-12\n)</code></pre>\n<table><tbody><tr><th></th><th>pwindow_bounds</th><th>swindow_bounds</th><th>obs_time_bounds</th></tr><tr><td>1</td><td>(1, 3)</td><td>(1, 3)</td><td>(8, 12)</td></tr><tr><td>2</td><td>(1, 3)</td><td>(1, 3)</td><td>(8, 12)</td></tr><tr><td>3</td><td>(1, 3)</td><td>(1, 3)</td><td>(8, 12)</td></tr><tr><td>4</td><td>(1, 3)</td><td>(1, 3)</td><td>(8, 12)</td></tr><tr><td>5</td><td>(1, 3)</td><td>(1, 3)</td><td>(8, 12)</td></tr><tr><td>6</td><td>(1, 3)</td><td>(1, 3)</td><td>(8, 12)</td></tr><tr><td>7</td><td>(1, 3)</td><td>(1, 3)</td><td>(8, 12)</td></tr><tr><td>8</td><td>(1, 3)</td><td>(1, 3)</td><td>(8, 12)</td></tr><tr><td>9</td><td>(1, 3)</td><td>(1, 3)</td><td>(8, 12)</td></tr><tr><td>10</td><td>(1, 3)</td><td>(1, 3)</td><td>(8, 12)</td></tr><tr><td>...</td></tr><tr><td>2000</td><td>(1, 3)</td><td>(1, 3)</td><td>(8, 12)</td></tr></tbody></table>\n\n\n<div class=\"markdown\"><h3 id=\"Simulate-from-the-double-censored-distribution-for-each-individual\">Simulate from the double censored distribution for each individual</h3></div>\n\n\n<div class=\"markdown\"><p>Using the double censored model, we simulate data by sampling from the model using known true parameters. We use Turing's simulation approach with DynamicPPL's <code>fix</code> function to set parameters to their true values and sample from the prior predictive distribution. This means we can use the same model for simulation and inference.</p></div>\n\n\n<div class=\"markdown\"><p>We first create the base model which only specifies bounds to sample for the observations processes - we'll use this for both simulation and fitting:</p></div>\n\n<pre class='language-julia'><code class='language-julia'>base_model = @with bounds_df begin\n    CensoredDistributions_model(:pwindow_bounds, :swindow_bounds, :obs_time_bounds)\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-base_model\">Model{typeof(CensoredDistributions_model), (:pwindow_bounds, :swindow_bounds, :obs_time_bounds), (), (), Tuple{Vector{Tuple{Int64, Int64}}, Vector{Tuple{Int64, Int64}}, Vector{Tuple{Int64, Int64}}}, Tuple{}, DefaultContext}(CensoredDistributions_model, (pwindow_bounds = [(1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3)  …  (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3)], swindow_bounds = [(1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3)  …  (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3)], obs_time_bounds = [(8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12)  …  (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12)]), NamedTuple(), DefaultContext())</pre>\n\n\n<div class=\"markdown\"><p>For simulation, fix the distribution parameters to known true values:</p></div>\n\n<pre class='language-julia'><code class='language-julia'>simulation_model = fix(\n    base_model,\n    (\n        @varname(dist.mu) =&gt; meanlog,\n        @varname(dist.sigma) =&gt; sdlog\n    )\n)</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-simulation_model\">Model{typeof(CensoredDistributions_model), (:pwindow_bounds, :swindow_bounds, :obs_time_bounds), (), (), Tuple{Vector{Tuple{Int64, Int64}}, Vector{Tuple{Int64, Int64}}, Vector{Tuple{Int64, Int64}}}, Tuple{}, DynamicPPL.FixedContext{Dict{VarName{:dist}, Float64}, DefaultContext}}(CensoredDistributions_model, (pwindow_bounds = [(1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3)  …  (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3)], swindow_bounds = [(1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3)  …  (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3), (1, 3)], obs_time_bounds = [(8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12)  …  (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12), (8, 12)]), NamedTuple(), FixedContext(Dict{AbstractPPL.VarName{:dist}, Float64}(dist.mu =&gt; 1.5, dist.sigma =&gt; 0.75), DynamicPPL.DefaultContext()))</pre>\n\n\n<div class=\"markdown\"><p>Now we can sample from the model using <code>rand</code> to get simmulated observations with their observation windows and relative observation time:</p></div>\n\n<pre class='language-julia'><code class='language-julia'>simulated_data = @chain simulation_model begin\n    rand\n    DataFrame\nend</code></pre>\n<table><tbody><tr><th></th><th>pwindows</th><th>swindows</th><th>obs_times</th><th>obs</th></tr><tr><td>1</td><td>2</td><td>1</td><td>11</td><td>8.0</td></tr><tr><td>2</td><td>1</td><td>1</td><td>10</td><td>3.0</td></tr><tr><td>3</td><td>3</td><td>1</td><td>8</td><td>6.0</td></tr><tr><td>4</td><td>1</td><td>1</td><td>8</td><td>3.0</td></tr><tr><td>5</td><td>3</td><td>3</td><td>10</td><td>9.0</td></tr><tr><td>6</td><td>2</td><td>3</td><td>11</td><td>0.0</td></tr><tr><td>7</td><td>3</td><td>2</td><td>8</td><td>4.0</td></tr><tr><td>8</td><td>1</td><td>1</td><td>11</td><td>7.0</td></tr><tr><td>9</td><td>2</td><td>3</td><td>10</td><td>6.0</td></tr><tr><td>10</td><td>2</td><td>3</td><td>10</td><td>6.0</td></tr><tr><td>...</td></tr><tr><td>2000</td><td>1</td><td>2</td><td>11</td><td>2.0</td></tr></tbody></table>\n\n\n<div class=\"markdown\"><h3 id=\"Visualise-the-simulated-data\">Visualise the simulated data</h3><p>To make handling the data easier and later to speed up our models we first create a dataframe with the data we just generated, aggregated to unique combinations and count occurrences.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>simulated_counts = @chain simulated_data begin\n    @transform :obs_upper = :obs .+ :swindows\n    @groupby All()\n    @combine :n = length(:pwindows)\nend</code></pre>\n<table><tbody><tr><th></th><th>pwindows</th><th>swindows</th><th>obs_times</th><th>obs</th><th>obs_upper</th><th>n</th></tr><tr><td>1</td><td>2</td><td>1</td><td>11</td><td>8.0</td><td>9.0</td><td>3</td></tr><tr><td>2</td><td>1</td><td>1</td><td>10</td><td>3.0</td><td>4.0</td><td>7</td></tr><tr><td>3</td><td>3</td><td>1</td><td>8</td><td>6.0</td><td>7.0</td><td>6</td></tr><tr><td>4</td><td>1</td><td>1</td><td>8</td><td>3.0</td><td>4.0</td><td>13</td></tr><tr><td>5</td><td>3</td><td>3</td><td>10</td><td>9.0</td><td>12.0</td><td>4</td></tr><tr><td>6</td><td>2</td><td>3</td><td>11</td><td>0.0</td><td>3.0</td><td>11</td></tr><tr><td>7</td><td>3</td><td>2</td><td>8</td><td>4.0</td><td>6.0</td><td>16</td></tr><tr><td>8</td><td>1</td><td>1</td><td>11</td><td>7.0</td><td>8.0</td><td>2</td></tr><tr><td>9</td><td>2</td><td>3</td><td>10</td><td>6.0</td><td>9.0</td><td>18</td></tr><tr><td>10</td><td>1</td><td>1</td><td>9</td><td>4.0</td><td>5.0</td><td>3</td></tr><tr><td>...</td></tr><tr><td>258</td><td>3</td><td>1</td><td>8</td><td>0.0</td><td>1.0</td><td>1</td></tr></tbody></table>\n\n\n<div class=\"markdown\"><p>Now let's compare the samples with and without double interval censoring to the true distribution. First let's calculate the empirical CDF:</p></div>\n\n<pre class='language-julia'><code class='language-julia'>empirical_cdf_obs = @with(simulated_counts, ecdf(:obs, weights = :n));</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'># Create a sequence of x values for the theoretical CDF\nx_seq = @with simulated_counts begin\n    range(minimum(:obs), stop = maximum(:obs) + 2, length = 100);\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>begin\n    # Calculate theoretical CDF using true log-normal distribution\n    theoretical_cdf = @chain x_seq begin\n        cdf.(true_dist, _)\n    end;\n\n    # Generate uncensored samples from the true distribution for comparison\n    uncensored_samples = rand(true_dist, n);\n    empirical_cdf_uncensored = ecdf(uncensored_samples);\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-uncensored_samples\">ECDF{Vector{Float64}, Weights{Float64, Float64, Vector{Float64}}}([0.2831019516631152, 0.3413904185802441, 0.38240225531907285, 0.40072833011369846, 0.4194702379951856, 0.44993332958009924, 0.5516367868777338, 0.6124876191977476, 0.6137408252214501, 0.6223403193551887  …  33.083613274309144, 34.414921875981186, 36.03496752826056, 37.426275686830756, 37.67560231106244, 37.80858368604233, 38.09976203612415, 50.744749999903185, 54.44121931693789, 62.94007431254143], Float64[])</pre>\n\n<pre class='language-julia'><code class='language-julia'>let\n    f = Figure()\n    ax = Axis(f[1, 1],\n        title = \"Comparison of Censored vs Uncensored vs Theoretical CDF\",\n        ylabel = \"Cumulative Probability\",\n        xlabel = \"Delay\"\n    )\n    scatter!(\n        ax,\n        x_seq,\n        empirical_cdf_obs.(x_seq),\n        label = \"Empirical CDF (Censored)\",\n        color = :blue\n    )\n    scatter!(\n        ax,\n        x_seq,\n        empirical_cdf_uncensored.(x_seq),\n        label = \"Empirical CDF (Uncensored)\",\n        color = :red,\n        marker = :cross\n    )\n    lines!(ax, x_seq, theoretical_cdf, label = \"Theoretical CDF\",\n        color = :black, linewidth = 2)\n    vlines!(\n        ax, [mean(simulated_data.obs)], color = :blue, linestyle = :dash,\n        label = \"Censored mean\", linewidth = 2)\n    vlines!(ax, [mean(uncensored_samples)], color = :red, linestyle = :dash,\n        label = \"Uncensored mean\", linewidth = 2)\n    vlines!(ax, [mean(true_dist)], linestyle = :dash,\n        label = \"Theoretical mean\", color = :black, linewidth = 2)\n    axislegend(position = :rb)\n\n    f\nend</code></pre>\n<img height=\"450\" src=\"data:image/png;base64, \" style=\"object-fit: contain; height: auto;\" width=\"600\"/>\n\n\n<div class=\"markdown\"><h2 id=\"Fitting-a-naive-model-using-Turing\">Fitting a naive model using Turing</h2><p>We'll now fit a naive model that ignores the censoring process. This model treats the observed delay data as if it came directly from the uncensored delay distribution, providing a baseline for comparison.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>@model function naive_model()\n    dist ~ to_submodel(latent_delay_dist())\n    obs ~ weight(dist)\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-naive_model\">naive_model (generic function with 2 methods)</pre>\n\n\n<div class=\"markdown\"><p>Now let's instantiate and condition this model using weighted observations. We use a small constant to avoid issues at zero (a hint that this model is misspecified) and condition directly using NamedTuple format <code>(values = values, weights = counts)</code> which enables joint observation conditioning.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>naive_mdl = @with simulated_counts begin\n    condition(naive_model(), obs = (values = :obs .+ 1e-6, weights = :n))\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-naive_mdl\">Model{typeof(naive_model), (), (), (), Tuple{}, Tuple{}, ConditionContext{@NamedTuple{obs::@NamedTuple{values::Vector{Float64}, weights::Vector{Int64}}}, DefaultContext}}(naive_model, NamedTuple(), NamedTuple(), ConditionContext((obs = (values = [8.000001, 3.000001, 6.000001, 3.000001, 9.000001, 1.0e-6, 4.000001, 7.000001, 6.000001, 4.000001, 6.000001, 2.000001, 6.000001, 4.000001, 8.000001, 4.000001, 3.000001, 6.000001, 3.000001, 7.000001, 8.000001, 2.000001, 4.000001, 2.000001, 6.000001, 2.000001, 6.000001, 6.000001, 1.000001, 2.000001, 5.000001, 4.000001, 2.000001, 4.000001, 5.000001, 6.000001, 6.000001, 4.000001, 1.0e-6, 3.000001, 3.000001, 3.000001, 1.0e-6, 3.000001, 10.000001, 6.000001, 4.000001, 2.000001, 2.000001, 2.000001, 3.000001, 3.000001, 7.000001, 2.000001, 3.000001, 2.000001, 1.0e-6, 2.000001, 8.000001, 6.000001, 3.000001, 9.000001, 8.000001, 3.000001, 3.000001, 3.000001, 3.000001, 4.000001, 4.000001, 3.000001, 8.000001, 3.000001, 4.000001, 10.000001, 2.000001, 6.000001, 6.000001, 3.000001, 9.000001, 5.000001, 5.000001, 2.000001, 4.000001, 1.000001, 6.000001, 6.000001, 5.000001, 5.000001, 1.0e-6, 1.0e-6, 6.000001, 1.0e-6, 3.000001, 6.000001, 4.000001, 6.000001, 9.000001, 4.000001, 6.000001, 2.000001, 3.000001, 1.0e-6, 7.000001, 5.000001, 4.000001, 2.000001, 3.000001, 1.0e-6, 6.000001, 6.000001, 4.000001, 3.000001, 4.000001, 6.000001, 6.000001, 3.000001, 1.0e-6, 7.000001, 4.000001, 4.000001, 6.000001, 9.000001, 2.000001, 3.000001, 6.000001, 3.000001, 6.000001, 1.000001, 10.000001, 8.000001, 9.000001, 1.0e-6, 6.000001, 4.000001, 2.000001, 4.000001, 8.000001, 4.000001, 8.000001, 1.0e-6, 3.000001, 6.000001, 2.000001, 8.000001, 5.000001, 4.000001, 1.0e-6, 5.000001, 4.000001, 1.000001, 7.000001, 4.000001, 9.000001, 6.000001, 2.000001, 1.0e-6, 5.000001, 6.000001, 2.000001, 8.000001, 2.000001, 8.000001, 2.000001, 1.000001, 1.0e-6, 6.000001, 3.000001, 4.000001, 6.000001, 6.000001, 9.000001, 9.000001, 7.000001, 8.000001, 1.0e-6, 8.000001, 6.000001, 10.000001, 4.000001, 1.0e-6, 4.000001, 8.000001, 2.000001, 1.0e-6, 6.000001, 9.000001, 2.000001, 7.000001, 9.000001, 2.000001, 6.000001, 3.000001, 5.000001, 4.000001, 6.000001, 8.000001, 5.000001, 5.000001, 7.000001, 9.000001, 2.000001, 6.000001, 6.000001, 6.000001, 1.0e-6, 1.0e-6, 5.000001, 1.000001, 7.000001, 2.000001, 6.000001, 7.000001, 9.000001, 7.000001, 1.0e-6, 10.000001, 1.0e-6, 8.000001, 7.000001, 1.000001, 2.000001, 1.000001, 3.000001, 1.000001, 1.0e-6, 1.0e-6, 9.000001, 8.000001, 10.000001, 1.0e-6, 6.000001, 9.000001, 8.000001, 10.000001, 10.000001, 8.000001, 7.000001, 2.000001, 6.000001, 6.000001, 5.000001, 1.0e-6, 1.000001, 1.0e-6, 10.000001, 1.000001, 11.000001, 1.0e-6, 8.000001, 9.000001, 1.000001, 1.0e-6, 1.000001, 1.000001, 11.000001, 1.0e-6, 9.000001, 1.0e-6], weights = [3, 7, 6, 13, 4, 11, 16, 2, 18, 3, 12, 22, 2, 12, 3, 9, 22, 20, 28, 4, 1, 22, 16, 10, 7, 20, 10, 11, 4, 17, 7, 9, 11, 15, 5, 16, 17, 16, 15, 22, 9, 3, 8, 26, 4, 14, 14, 10, 15, 14, 20, 8, 2, 9, 19, 4, 2, 6, 6, 9, 24, 9, 4, 11, 22, 20, 20, 21, 16, 24, 7, 4, 5, 2, 10, 7, 11, 13, 3, 3, 7, 13, 6, 6, 4, 14, 5, 11, 3, 16, 15, 9, 19, 11, 6, 13, 8, 15, 6, 6, 8, 11, 6, 6, 7, 11, 6, 1, 17, 9, 5, 20, 3, 9, 21, 24, 5, 6, 10, 8, 10, 6, 6, 14, 7, 12, 8, 1, 6, 7, 3, 7, 9, 5, 3, 21, 7, 5, 6, 9, 8, 5, 7, 2, 6, 6, 9, 8, 6, 5, 4, 7, 3, 17, 8, 9, 8, 6, 5, 5, 5, 2, 9, 2, 5, 13, 6, 11, 1, 3, 5, 1, 7, 4, 4, 2, 9, 2, 9, 2, 11, 9, 8, 11, 6, 1, 7, 3, 3, 10, 8, 10, 5, 5, 5, 1, 5, 7, 2, 4, 4, 3, 3, 12, 1, 2, 9, 4, 7, 11, 5, 3, 3, 3, 12, 2, 3, 6, 2, 1, 2, 4, 9, 2, 3, 4, 2, 3, 1, 4, 4, 3, 1, 4, 1, 3, 3, 3, 4, 9, 4, 2, 3, 4, 2, 1, 1, 2, 1, 1, 2, 1, 1, 2, 2, 1, 3, 1]),), DynamicPPL.DefaultContext()))</pre>\n\n\n<div class=\"markdown\"><p>Now let's fit the conditioned model using the joint observation pattern <code>(values = values, weights = counts)</code>.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>naive_fit = sample(naive_mdl, NUTS(), MCMCThreads(), 500, 4);</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>summarize(naive_fit)</code></pre>\n<table><tbody><tr><th></th><th>parameters</th><th>mean</th><th>std</th><th>mcse</th><th>ess_bulk</th><th>ess_tail</th><th>rhat</th><th>ess_per_sec</th></tr><tr><td>1</td><td>Symbol(\"dist.mu\")</td><td>0.0340606</td><td>0.100273</td><td>0.00233815</td><td>1840.59</td><td>1523.68</td><td>1.00023</td><td>302.878</td></tr><tr><td>2</td><td>Symbol(\"dist.sigma\")</td><td>4.32734</td><td>0.0669993</td><td>0.00147371</td><td>2065.46</td><td>1611.07</td><td>1.00223</td><td>339.881</td></tr></tbody></table>\n\n<pre class='language-julia'><code class='language-julia'>plot_fit_with_truth(naive_fit, Dict(\"dist.mu\" =&gt; meanlog, \"dist.sigma\" =&gt; sdlog))</code></pre>\n<img height=\"435\" src=\"data:image/png;base64, \" style=\"object-fit: contain; height: auto;\" width=\"538\"/>\n\n\n<div class=\"markdown\"><p>We see that the model has converged and the diagnostics look good. However, just from the model posterior summary we see that we might not be very happy with the fit. <code>mu</code> is smaller than the target 1.5 and <code>sigma</code> is larger than the target 0.75.</p></div>\n\n\n<div class=\"markdown\"><h2 id=\"Fitting-a-truncation-adjusted-interval-model\">Fitting a truncation-adjusted interval model</h2><p>Now let's fit an intermediate model that accounts for interval censoring and right truncation but ignores the primary censoring process. This provides a comparison point between the naive model and the full model.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>@model function interval_only_model(swindow_bounds, obs_time_bounds)\n    swindows ~ arraydist([Uniform(sw[1], sw[2]) for sw in swindow_bounds])\n    obs_times ~ arraydist([Uniform(ot[1], ot[2]) for ot in obs_time_bounds])\n\n    dist ~ to_submodel(latent_delay_dist())\n\n    icens_dists = map(obs_times, swindows) do D, sw\n        truncated(interval_censored(dist, sw), upper = D)\n    end\n    obs ~ weight(icens_dists)\n    return obs\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-interval_only_model\">interval_only_model (generic function with 2 methods)</pre>\n\n\n<div class=\"markdown\"><p>Create the interval-only model with bounds, fix the window parameters, and condition on observations</p></div>\n\n<pre class='language-julia'><code class='language-julia'>interval_only_mdl = @with simulated_counts begin\n    @chain interval_only_model(bounds_df.swindow_bounds, bounds_df.obs_time_bounds) begin\n        fix((\n            @varname(swindows) =&gt; :swindows,\n            @varname(obs_times) =&gt; :obs_times\n        ))\n        condition(obs = (values = :obs, weights = :n))\n    end\nend;</code></pre>\n\n\n\n<div class=\"markdown\"><p>Fit the interval-only model (<em>Note: <code>Turing.jl</code> supports a wide range of fitting methods but here we use the No-U-turn sampler</em>):</p></div>\n\n<pre class='language-julia'><code class='language-julia'>interval_only_fit = sample(interval_only_mdl, NUTS(), MCMCThreads(), 500, 4);</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>summarize(interval_only_fit)</code></pre>\n<table><tbody><tr><th></th><th>parameters</th><th>mean</th><th>std</th><th>mcse</th><th>ess_bulk</th><th>ess_tail</th><th>rhat</th><th>ess_per_sec</th></tr><tr><td>1</td><td>Symbol(\"dist.mu\")</td><td>1.82271</td><td>0.0409126</td><td>0.00198909</td><td>428.632</td><td>511.41</td><td>1.01478</td><td>16.2213</td></tr><tr><td>2</td><td>Symbol(\"dist.sigma\")</td><td>0.672637</td><td>0.0252599</td><td>0.00119014</td><td>454.916</td><td>688.293</td><td>1.0107</td><td>17.216</td></tr></tbody></table>\n\n\n<div class=\"markdown\"><p>Lets plot the posterior compared to the true values again. *Note: An annoying feature to <code>to_submodel()</code> is that it automatically prefixes the LHS name to all variables names in the model meaning we need to customise our postprocessing or turn this feature off.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>plot_fit_with_truth(interval_only_fit, Dict(\"dist.mu\" =&gt; meanlog, \"dist.sigma\" =&gt; sdlog))</code></pre>\n<img height=\"437\" src=\"data:image/png;base64, \" style=\"object-fit: contain; height: auto;\" width=\"552\"/>\n\n\n<div class=\"markdown\"><h2 id=\"Fitting-the-double-censored-model\">Fitting the double censored model</h2><p>Now we'll fit the full model that accounts for the censoring process. Since the CensoredDistributions_model was defined earlier and used for simulation, we'll reuse it for fitting. Here we fix the censoring windows and observation time based on the observed data and then condition on the weighted observations.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>CensoredDistributions_mdl = @with simulated_counts begin\n    @chain base_model begin\n        fix((\n            @varname(pwindows) =&gt; :pwindows,\n            @varname(swindows) =&gt; :swindows,\n            @varname(obs_times) =&gt; :obs_times\n        ))\n        condition(obs = (values = :obs, weights = :n))\n    end\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>CensoredDistributions_mdl()</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-hash535185\">(values = [8.0, 3.0, 6.0, 3.0, 9.0, 0.0, 4.0, 7.0, 6.0, 4.0  …  8.0, 9.0, 1.0, 0.0, 1.0, 1.0, 11.0, 0.0, 9.0, 0.0], weights = [3, 7, 6, 13, 4, 11, 16, 2, 18, 3  …  1, 1, 2, 1, 1, 2, 2, 1, 3, 1])</pre>\n\n\n<div class=\"markdown\"><p>Now we fit the model to recover the true parameters from the synthetic data we generated earlier. This demonstrates the package's ability to perform accurate parameter recovery when the censoring process is properly modelled.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>CensoredDistributions_fit = sample(\n    CensoredDistributions_mdl, NUTS(), MCMCThreads(), 1000, 4);</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>summarize(CensoredDistributions_fit)</code></pre>\n<table><tbody><tr><th></th><th>parameters</th><th>mean</th><th>std</th><th>mcse</th><th>ess_bulk</th><th>ess_tail</th><th>rhat</th><th>ess_per_sec</th></tr><tr><td>1</td><td>Symbol(\"dist.mu\")</td><td>1.50646</td><td>0.0396906</td><td>0.00122084</td><td>1082.81</td><td>1480.66</td><td>1.0026</td><td>21.8365</td></tr><tr><td>2</td><td>Symbol(\"dist.sigma\")</td><td>0.76384</td><td>0.0318833</td><td>0.000959003</td><td>1118.72</td><td>1524.82</td><td>1.00422</td><td>22.5608</td></tr></tbody></table>\n\n<pre class='language-julia'><code class='language-julia'>plot_fit_with_truth(\n    CensoredDistributions_fit, Dict(\"dist.mu\" =&gt; meanlog, \"dist.sigma\" =&gt; sdlog))</code></pre>\n<img height=\"437\" src=\"data:image/png;base64, \" style=\"object-fit: contain; height: auto;\" width=\"552\"/>\n\n\n<div class=\"markdown\"><p>We see that the model has converged and the diagnostics look good. We also see that the posterior means are near the true parameters and the 90% credible intervals include the true parameters.</p></div>\n\n<!-- PlutoStaticHTML.End -->","category":"page"},{"location":"release-notes/#Release-notes","page":"Release notes","title":"Release notes","text":"","category":"section"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"CensoredDistributions.jl follows a hybrid changelog approach:","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"GitHub Releases: All releases (automatically generated by TagBot)\nNEWS.md: Major releases requiring detailed context (shown below)","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"See GitHub Releases for minor/patch release information.","category":"page"},{"location":"release-notes/#v0.1.0-Initial-Release","page":"Release notes","title":"v0.1.0 - Initial Release","text":"","category":"section"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"CensoredDistributions.jl extends Distributions.jl to support primary event censoring and interval censoring, enabling modelling of scenarios where observation times are subject to various forms of censoring and truncation.","category":"page"},{"location":"release-notes/#Core-Functionality","page":"Release notes","title":"Core Functionality","text":"","category":"section"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"Distribution Constructors","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"primary_censored(dist, primary_event): Creates primary event censored distributions where an initiating event occurs within a time window, then experiences a delay\ninterval_censored(dist, interval): Creates interval censored distributions for continuous values observed only within discrete intervals (regular or arbitrary intervals)\ndouble_interval_censored(dist; kwargs...): Combines primary event censoring, optional truncation, and optional secondary interval censoring in an appropriate mathematical sequence","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"Distribution Types","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"PrimaryCensored{D, P}: Wraps delay distribution D with primary event distribution P\nIntervalCensored{D, T}: Wraps continuous distribution D with interval boundaries of type T\nDoubleIntervalCensored: Composition of multiple censoring mechanisms","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"Extensible CDF Method","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"primarycensored_cdf(): User-extensible method for computing CDFs of primary censored distributions with analytical solutions for common distribution pairs","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"Utility Functions","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"weight(dist, weights): Creates weighted distributions for efficient likelihood computation","category":"page"},{"location":"release-notes/#Distributions.jl-Interface","page":"Release notes","title":"Distributions.jl Interface","text":"","category":"section"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"Partial implementation of Distributions.jl interface including:","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"pdf, logpdf: Probability density functions\ncdf, logcdf: Cumulative distribution functions\nquantile: Inverse CDF (where analytically tractable)\nrand: Random number generation\nminimum, maximum, insupport: Support queries\nmean, var, std: Moments (where analytically tractable)","category":"page"},{"location":"release-notes/#Migration-from-primarycensored-R-Package","page":"Release notes","title":"Migration from primarycensored R Package","text":"","category":"section"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"CensoredDistributions.jl provides a Julia-native implementation with enhanced functionality compared to the primarycensored R package:","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"Function Mapping","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"R's dprimarycensored() → Julia's pdf(primary_censored(...))\nR's pprimarycensored() → Julia's cdf(primary_censored(...))\nR's qprimarycensored() → Julia's quantile(primary_censored(...))\nR's rprimarycensored() → Julia's rand(primary_censored(...))","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"Parameter Differences","category":"page"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"Primary event window: Use primary_event = Uniform(0, pwindow) instead of R's pwindow parameter\nSolver selection: Configure via solver keyword instead of R's integration method parameters\nTruncation: Apply via truncated() from Distributions.jl or use double_interval_censored() convenience function","category":"page"},{"location":"release-notes/#Contributors","page":"Release notes","title":"Contributors","text":"","category":"section"},{"location":"release-notes/","page":"Release notes","title":"Release notes","text":"Sam Abbott (@seabbs)\nDamon Bayer (@damonbayer)\nSam Brand (@sambrand)\nMichael DeWitt (@dewittpe)\nJoseph Lemaitre","category":"page"},{"location":"getting-started/#getting-started","page":"Overview","title":"Getting started","text":"","category":"section"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Welcome to the CensoredDistributions documentation! This section is designed to help you get started with the package. It includes a quickstart guide, frequently asked questions (FAQ) section, and tutorials that will help you get started with CensoredDistributions for specific tasks. See the sidebar for the list of topics.","category":"page"},{"location":"getting-started/#Introduction","page":"Overview","title":"Introduction","text":"","category":"section"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Delay distributions play a crucial role in various fields, including epidemiology, reliability analysis, and survival analysis. These distributions describe the time between two events of interest, such as the incubation period of a disease or the time to failure of a component. Accurately estimating and calculating these distributions is essential for understanding the underlying processes and making informed decisions.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"The estimation of delay distributions often faces the following challenges:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Primary event within interval censoring: The primary event (e.g., exposure to a pathogen or the start of a process) is often observed with some degree of interval censoring. This means that the exact time of the event is not known, but rather, it is known to have occurred within a certain time interval, commonly a day.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"As a result, any distribution based on these primary events is a combination of the underlying true distribution and the censoring distribution.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Truncation: The observation of delay distributions is often conditioned on the occurrence of the secondary event. This leads to a truncation of the observed distribution, as delays longer than the observation time are not captured in the data.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Consequently, the observed distribution is a combination of the underlying true distribution, the censoring distribution, and the observation time.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Secondary event within interval censoring: The secondary event (e.g., symptom onset or the end of a process) is also frequently observed with within an interval.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"This additional layer of censoring further complicates the estimation of the delay distribution.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Double event within interval censoring Both the primary and secondary events are censored so that we know they occurred in an interval but not precisely when.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"The CensoredDistributions.jl package aims to address these challenges by providing tools to manipulate primary censored delay distributions and to extend these distributions to account for both truncation and secondary event censoring. By accounting for the censoring and truncation present in the data, the package enables more accurate estimation and use of the underlying true distribution.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"In this quickstart, we will provide a quick introduction to the main functions and concepts in the CensoredDistributions.jl package. We will cover the mathematical formulation of the problem, demonstrate the usage of the key functions, and provide signposting on how to learn more.","category":"page"},{"location":"getting-started/#Packages-used-in-this-getting-started-guide","page":"Overview","title":"Packages used in this getting started guide","text":"","category":"section"},{"location":"getting-started/#Loading-the-packages","page":"Overview","title":"Loading the packages","text":"","category":"section"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"# Import the package\nusing CensoredDistributions\nusing Distributions\nusing Random\nusing Plots\n\n# Set the seed for reproducibility\nRandom.seed!(123)","category":"page"},{"location":"getting-started/#Primary-event-censoring","page":"Overview","title":"Primary event censoring","text":"","category":"section"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"The mathematical formulation for primary event censoring involves several key steps:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Primary event times (p) are generated from a specified primary event distribution, in this case uniform between 0 and 1:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"primary_event = Uniform(0, 1)","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Delays (d) are generated from a specified delay distribution, here a log-normal:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"dist = LogNormal(1.5, 0.75)","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"This corresponds to: d sim textLogNormal(15 075) quad d geq 0","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"x = 0:0.01:15\nplot(x, pdf.(dist, x))","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Total delays (t) are calculated by adding the primary event times and delays: t = p + d","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Now we combine these two distributions to create a primary censored distribution:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"prim_dist = primary_censored(dist, primary_event)","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"The primary event censored cumulative distribution function (CDF) is given by:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"F_textcens(q) = int_0^1 F(q - p) cdot f_textprimary(p)  dp","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"where F is the CDF of the delay distribution and f_textprimary is the PDF of the primary event times.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"For theory explained in more detail, see the primary_censored documentation.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"We can now generate a random sample from the primary distribution","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Random.seed!(123)\nrand(prim_dist, 10)","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"and plot the CDF compared to the unmodified distribution.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"x = 0:0.01:15\nplot(x, cdf.(dist, x), label=\"Uncensored\")\nplot!(x, cdf.(prim_dist, x), label=\"Primary censored\")","category":"page"},{"location":"getting-started/#Truncation","page":"Overview","title":"Truncation","text":"","category":"section"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Truncation is applied to ensure delays are within the specified range 0 D, where D is the maximum observable delay. This step filters out delays longer than the observation time:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"t_texttruncated = t mid 0 leq t  D","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"If the maximum delay D is finite, the CDF is normalised by dividing by F_textcens(D):","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"F_textcensnorm(q) = fracF_textcens(q)F_textcens(D)","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"We can apply truncation using the normal truncated function from Distributions.jl:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"trunc_prim_dist = truncated(prim_dist, upper=10)","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"We can again sample from the distribution","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Random.seed!(123)\nrand(trunc_prim_dist, 10)","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"or plot the CDFs of the different distributions:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"x = 0:0.01:15\nplot(x, cdf.(dist, x), label=\"Uncensored\")\nplot!(x, cdf.(prim_dist, x), label=\"Primary censored\")\nplot!(x, cdf.(trunc_prim_dist, x), label=\"Truncated and primary censored\")","category":"page"},{"location":"getting-started/#Secondary-interval-censoring","page":"Overview","title":"Secondary interval censoring","text":"","category":"section"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"We can now apply secondary interval censoring using the interval_censored function. This censors observations to fall within specified intervals.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"The secondary event censoring process rounds the truncated delays to the nearest secondary event window (textswindow):","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"t_textvalid = lfloor fract_texttruncatedtextswindow rfloor times textswindow","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"For discrete data or when working with specific time windows (such as daily reporting delays), this step is particularly important. The primary event censored probability mass function (PMF), f_textcens(d), accounts for this secondary event censoring and is given by:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"f_textcens(d) = F_textcens(d + textswindow) - F_textcens(d)","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"where F_textcens is the potentially right truncated primary event censored CDF and textswindow is the secondary event window.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"int_censored_dist = interval_censored(trunc_prim_dist, 1)","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Again we can sample from the distribution.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Random.seed!(123)\nrand(int_censored_dist, 10)","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"or plot the CDFs of the different distributions.","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"x = 0:0.01:15\nplot(x, cdf.(dist, x), label=\"Uncensored\")\nplot!(x, cdf.(prim_dist, x), label=\"Primary censored\")\nplot!(x, cdf.(trunc_prim_dist, x), label=\"Truncated and primary censored\")\nplot!(x, cdf.(int_censored_dist, x), label=\"Truncated, primary censored, and interval censored\")","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Neither the primary censored nor the interval censored distributions match the true distribution due to the censoring effects and truncation at the maximum observable delay, which biases both observed distributions towards shorter delays.","category":"page"},{"location":"getting-started/#Convenience-Function:-double_interval_censored","page":"Overview","title":"Convenience Function: double_interval_censored","text":"","category":"section"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"For common workflows involving the complete pipeline of primary censoring, truncation, and secondary interval censoring, the package provides a convenient double_interval_censored function that applies all transformations in the correct order (primary censoring → truncation → interval censoring):","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"# This is equivalent to the step-by-step approach above\ndouble_censored_dist = double_interval_censored(Gamma(2, 1); upper=8, interval=2)","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"As with all the other functions, we can sample from the distribution","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Random.seed!(123)\nrand(double_censored_dist, 10)","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"or do any of the other common distribution operations.","category":"page"},{"location":"getting-started/#Key-Package-Features","page":"Overview","title":"Key Package Features","text":"","category":"section"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"In addition to these main functions, the package also includes:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Distributions.jl integration: Full compatibility with the Distributions.jl ecosystem, supporting all standard distribution methods (pdf, cdf, quantile, rand, etc.).\nAnalytical solutions: For common combinations of primary event and delay distributions (e.g., uniform primary events with gamma, lognormal, or Weibull delays), analytical solutions provide significant computational speedups compared to numerical integration.\nAutomatic differentiation compatibility: Full support for automatic differentiation backends including ForwardDiff.jl, ReverseDiff.jl, Mooncake.jl, and Enzyme.jl for use in probabilistic programming and optimisation.\nType stability: Efficient implementation with type-stable operations for high-performance computation.","category":"page"},{"location":"getting-started/#Learning-more","page":"Overview","title":"Learning more","text":"","category":"section"},{"location":"getting-started/#tutorials","page":"Overview","title":"Tutorials","text":"","category":"section"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"For more information on the package and its integration with other packages, see the tutorials in this getting started section:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Analytical CDF Solutions: Understanding analytical solutions for common distribution pairs\nFitting with Turing.jl: Bayesian inference with censored distributions\nExponentially Tilted Primary Events: Understanding the impact of exponentially tilted primary events on primary event timing and the knock on impact to primary event censored distributions","category":"page"},{"location":"getting-started/#Methodological-Background","page":"Overview","title":"Methodological Background","text":"","category":"section"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"For methodological background on delay distributions and censoring methods, see:","category":"page"},{"location":"getting-started/","page":"Overview","title":"Overview","text":"Park et al. (2024): \"Estimating epidemiological delay distributions for infectious diseases\" - Provides detailed mathematical foundations and methodological guidance for delay distribution estimation.\nCharniga et al. (2024): \"Best practices for estimating and reporting epidemiological delay distributions of infectious diseases using public health surveillance and healthcare data\" - Offers best practices and practical advice when estimating delay distributions from real-world data.\nThe primarycensored R package documentation provides additional theoretical context and examples.","category":"page"},{"location":"getting-started/tutorials/exponentially-tilted-primary-events/","page":"Exponentially Tilted Primary Events","title":"Exponentially Tilted Primary Events","text":"<style>\n    #documenter-page table {\n        display: table !important;\n        margin: 2rem auto !important;\n        border-top: 2pt solid rgba(0,0,0,0.2);\n        border-bottom: 2pt solid rgba(0,0,0,0.2);\n    }\n\n    #documenter-page pre, #documenter-page div {\n        margin-top: 1.4rem !important;\n        margin-bottom: 1.4rem !important;\n    }\n\n    .code-output {\n        padding: 0.7rem 0.5rem !important;\n    }\n\n    .admonition-body {\n        padding: 0em 1.25em !important;\n    }\n</style>\n\n<!-- PlutoStaticHTML.Begin -->\n<!--\n    # This information is used for caching.\n    [PlutoStaticHTML.State]\n    input_sha = \"692d99021f4a78f2fa01ab2557052210d90edc95841477a25795cbe8f859e5e1\"\n    julia_version = \"1.11.7\"\n-->\n\n\n\n\n<div class=\"markdown\"><h1 id=\"How-Exponentially-Tilted-Primary-Events-Affect-Observed-Delay-Distributions\">How Exponentially Tilted Primary Events Affect Observed Delay Distributions</h1><h2 id=\"Introduction\">Introduction</h2><h3 id=\"What-are-we-going-to-do-in-this-exercise\">What are we going to do in this exercise</h3><p>We'll demonstrate how epidemic growth creates additional bias in observed delay distributions through primary event censoring - distinct from truncation bias. We'll cover:</p><ol><li><p>Exponentially tilted vs Uniform primary events</p></li><li><p>Double interval censoring effects</p></li><li><p>Impact on delay distributions</p></li></ol><h3 id=\"What-might-I-need-to-know-before-starting\">What might I need to know before starting</h3><p>This tutorial builds on <a href=\"@ref getting-started\">Getting Started with CensoredDistributions.jl</a> and focusses on <strong>exponentially tilted primary events</strong> - when primary events occur non-uniformly within observation windows (due here to exponential dynamics).</p><p>During epidemic growth/decline, primary events don't occur uniformly within our observation window:</p><ul><li><p><strong>Growth phase</strong>: Recent primary events over-represented → shorter observed delays</p></li><li><p><strong>Decline phase</strong>: Older primary events more represented → longer observed delays</p></li><li><p><strong>Steady state</strong>: Uniform timing → minimal additional bias</p></li></ul></div>\n\n\n<div class=\"markdown\"><h2 id=\"Setup\">Setup</h2><h3 id=\"Packages-used\">Packages used</h3></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    using CensoredDistributions\n    using Distributions\n    using Plots\n    using StatsPlots\n    using DataFramesMeta\n    using Statistics\n    using Random\n\n    Random.seed!(123)\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-Distributions\">TaskLocalRNG()</pre>\n\n\n<div class=\"markdown\"><h3 id=\"Simulated-scenarios\">Simulated scenarios</h3><p>We'll examine epidemic phase bias using a realistic scenario:</p><ul><li><p><strong>True incubation period</strong>: Gamma(4.0, 1.5) with mean 6.0 days</p></li><li><p><strong>Primary event windows</strong>: 7-day observation periods</p></li><li><p><strong>Growth rate scenarios</strong>: r ∈ {-10%, -5%, 0%, +5%, +10%}</p></li></ul></div>\n\n<pre class='language-julia'><code class='language-julia'>true_delay = Gamma(4.0, 1.5);</code></pre>\n\n\n\n<div class=\"markdown\"><h2 id=\"Part-1:-Exponentially-Tilted-vs-Uniform-Primary-Events\">Part 1: Exponentially Tilted vs Uniform Primary Events</h2><p>First, we compare how Exponentially tilted distributions with different growth rates shape primary event timing compared to uniform (steady state) patterns.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    # Create scenario data directly in DataFrame\n    window_length = 7\n    scenarios_df = @chain DataFrame(\n        name = [\"Decline 10%\", \"Decline 5%\", \"Steady\", \"Growth 5%\", \"Growth 10%\"],\n        r = [-0.10, -0.05, 0.0, 0.05, 0.10],\n        color = [:darkgreen, :lightgreen, :blue, :orange, :red]\n    ) begin\n        @transform :window = window_length\n    end\n\n    # Create primary event distributions\n    @chain scenarios_df begin\n        @transform! :primary_event = ExponentiallyTilted.(0.0, :window, :r)\n        @transform! :uniform_ref = Uniform.(0.0, :window)\n    end\nend</code></pre>\n<table><tbody><tr><th></th><th>name</th><th>r</th><th>color</th><th>window</th><th>primary_event</th><th>uniform_ref</th></tr><tr><td>1</td><td>\"Decline 10%\"</td><td>-0.1</td><td>:darkgreen</td><td>7</td><td>ExponentiallyTilted{Float64}(min=0.0, max=7.0, r=-0.1)</td><td>Distributions.Uniform{Float64}(a=0.0, b=7.0)</td></tr><tr><td>2</td><td>\"Decline 5%\"</td><td>-0.05</td><td>:lightgreen</td><td>7</td><td>ExponentiallyTilted{Float64}(min=0.0, max=7.0, r=-0.05)</td><td>Distributions.Uniform{Float64}(a=0.0, b=7.0)</td></tr><tr><td>3</td><td>\"Steady\"</td><td>0.0</td><td>:blue</td><td>7</td><td>ExponentiallyTilted{Float64}(min=0.0, max=7.0, r=0.0)</td><td>Distributions.Uniform{Float64}(a=0.0, b=7.0)</td></tr><tr><td>4</td><td>\"Growth 5%\"</td><td>0.05</td><td>:orange</td><td>7</td><td>ExponentiallyTilted{Float64}(min=0.0, max=7.0, r=0.05)</td><td>Distributions.Uniform{Float64}(a=0.0, b=7.0)</td></tr><tr><td>5</td><td>\"Growth 10%\"</td><td>0.1</td><td>:red</td><td>7</td><td>ExponentiallyTilted{Float64}(min=0.0, max=7.0, r=0.1)</td><td>Distributions.Uniform{Float64}(a=0.0, b=7.0)</td></tr></tbody></table>\n\n\n<div class=\"markdown\"><p>Created 5 epidemic scenarios for comparison. Now lets plot the primary event timing distributions.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    # Compare ExponentiallyTilted vs Uniform primary events\n    x_primary = range(0, window_length, length = 100)\n\n    p1 = plot(title = \"Primary Event Timing: ExponentiallyTilted vs Uniform\",\n        xlabel = \"Days before observation end\", ylabel = \"Probability density\",\n        size = (700, 400), legend = :topright)\n\n    # Plot ExponentiallyTilted distributions\n    for row in eachrow(scenarios_df)\n        y_exponential = pdf.(row.primary_event, x_primary)\n        plot!(p1, x_primary, y_exponential,\n            label = \"$(row.name) (r=$(row.r))\",\n            color = row.color, linewidth = 3)\n    end\n\n    # Add uniform reference (steady state comparison)\n    uniform_ref = Uniform(0.0, window_length)\n    y_uniform = pdf.(uniform_ref, x_primary)\n    plot!(p1, x_primary, y_uniform,\n        label = \"Uniform (reference)\", color = :black,\n        linestyle = :dash, linewidth = 2)\n\n    p1\nend</code></pre>\n<img src=\"data:image/svg+xml;base64,\"/>\n\n\n<div class=\"markdown\"><h2 id=\"Part-2:-Double-Interval-Censoring---Primary-+-Secondary-Windows\">Part 2: Double Interval Censoring - Primary + Secondary Windows</h2><p>Now we demonstrate the <strong>double interval censoring</strong> concept: primary events occur within surveillance-defined primary windows, but during epidemics their timing distribution becomes non-uniform (ExponentiallyTilted), then we observe delays within secondary windows (surveillance window minus primary event time). For the secondary even the distribution doesn't impact what we observe (see references for why).</p></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    # Demonstrate effective censoring windows from combining primary + secondary\n    n_samples = 1000000\n    secondary_window = 7.0  # Secondary window length\n\n    # DataFramesMeta lacks nest/unnest so we have to get clunky\n    censoring_windows_df = @chain scenarios_df begin\n        vcat([DataFrame(\n                  name = fill(row.name, n_samples),\n                  r = fill(row.r, n_samples),\n                  color = fill(row.color, n_samples),\n                  sample_id = 1:n_samples,\n                  primary_time = rand(row.primary_event, n_samples)\n              ) for row in eachrow(_)]...)\n        @transform :effective_window = secondary_window .- :primary_time\n    end\nend</code></pre>\n<table><tbody><tr><th></th><th>name</th><th>r</th><th>color</th><th>sample_id</th><th>primary_time</th><th>effective_window</th></tr><tr><td>1</td><td>\"Decline 10%\"</td><td>-0.1</td><td>:darkgreen</td><td>1</td><td>6.34621</td><td>0.653787</td></tr><tr><td>2</td><td>\"Decline 10%\"</td><td>-0.1</td><td>:darkgreen</td><td>2</td><td>3.45682</td><td>3.54318</td></tr><tr><td>3</td><td>\"Decline 10%\"</td><td>-0.1</td><td>:darkgreen</td><td>3</td><td>1.80008</td><td>5.19992</td></tr><tr><td>4</td><td>\"Decline 10%\"</td><td>-0.1</td><td>:darkgreen</td><td>4</td><td>3.0829</td><td>3.9171</td></tr><tr><td>5</td><td>\"Decline 10%\"</td><td>-0.1</td><td>:darkgreen</td><td>5</td><td>5.46401</td><td>1.53599</td></tr><tr><td>6</td><td>\"Decline 10%\"</td><td>-0.1</td><td>:darkgreen</td><td>6</td><td>0.208077</td><td>6.79192</td></tr><tr><td>7</td><td>\"Decline 10%\"</td><td>-0.1</td><td>:darkgreen</td><td>7</td><td>2.6682</td><td>4.3318</td></tr><tr><td>8</td><td>\"Decline 10%\"</td><td>-0.1</td><td>:darkgreen</td><td>8</td><td>2.01581</td><td>4.98419</td></tr><tr><td>9</td><td>\"Decline 10%\"</td><td>-0.1</td><td>:darkgreen</td><td>9</td><td>0.528221</td><td>6.47178</td></tr><tr><td>10</td><td>\"Decline 10%\"</td><td>-0.1</td><td>:darkgreen</td><td>10</td><td>4.50217</td><td>2.49783</td></tr><tr><td>...</td></tr><tr><td>5000000</td><td>\"Growth 10%\"</td><td>0.1</td><td>:red</td><td>1000000</td><td>5.36782</td><td>1.63218</td></tr></tbody></table>\n\n\n<div class=\"markdown\"><p>Now we can plot the distribution of effective censoring windows by scenario.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    # Plot distribution of effective censoring windows by scenario\n    p2 = plot(\n        title = \"Distribution of Effective Censoring Windows by Epidemic Phase\",\n        xlabel = \"Effective censoring window (days)\",\n        ylabel = \"Density\",\n        size = (700, 400),\n        legend = :topright\n    )\n\n    # Plot density for each scenario\n    for scenario_name in unique(censoring_windows_df.name)\n        scenario_data = @subset(censoring_windows_df, :name .== scenario_name)\n        scenario_color = scenario_data.color[1]\n\n        # Use StatsPlots density plot\n        density!(p2, scenario_data.effective_window,\n            label = scenario_name,\n            color = scenario_color,\n            linewidth = 3,\n            alpha = 0.7)\n    end\n\n    p2\nend</code></pre>\n<img src=\"data:image/svg+xml;base64,\"/>\n\n\n<div class=\"markdown\"><h2 id=\"Part-3:-Impact-on-Censored-Delay-Distributions\">Part 3: Impact on Censored Delay Distributions</h2><p>Now we examine how epidemic phase bias affects the delays we might observe. We start with the primary censored delay distributions. Note that most of the time, we won't observe these continuous distributions as the secondary event will also be censored.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    # Setup the primary censored distributions\n    @chain scenarios_df begin\n        @transform! :censored_dist = primary_censored.(Ref(true_delay), :primary_event)\n    end\n\n    # Visualise observed vs true delay distributions\n    x_delay = range(0, 15, length = 100)\n\n    p3 = plot(title = \"Observed vs True Delay Distributions\",\n        xlabel = \"Delay (days)\", ylabel = \"Probability density\",\n        size = (700, 400))\n\n    # True distribution (reference)\n    y_true = pdf.(true_delay, x_delay)\n    plot!(p3, x_delay, y_true,\n        label = \"True distribution\", color = :black,\n        linestyle = :dash, linewidth = 3)\n\n    # Observed distributions for each epidemic phase\n    for row in eachrow(scenarios_df)\n        y_obs = pdf.(row.censored_dist, x_delay)\n        plot!(p3, x_delay, y_obs,\n            label = \"$(row.name) (r=$(row.r))\",\n            color = row.color, linewidth = 2)\n    end\n\n    p3\nend</code></pre>\n<img src=\"data:image/svg+xml;base64,\"/>\n\n\n<div class=\"markdown\"><p>We can also plot the impact on the double censored distribution (which is what we would often observe). Here we show the CDF.</p></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    # Setup the double interval censored distributions\n    @chain scenarios_df begin\n        @rtransform! :double_censored_dist = double_interval_censored(\n            true_delay; primary_event = :primary_event,\n            interval = secondary_window\n        )\n    end\n\n    # Visualise double vs single censored delay distributions\n    x_delay_d = range(0, 40, length = 100)\n\n    # True distribution (reference)\n    y_true_d = cdf.(true_delay, x_delay_d)\n    p4 = plot(title = \"Double vs Single Interval Censored Distributions\",\n        xlabel = \"Delay (days)\", ylabel = \"Probability density\",\n        size = (700, 400))\n\n    plot!(p4, x_delay_d, y_true_d,\n        label = \"True distribution\", color = :black,\n        linestyle = :dash, linewidth = 3)\n\n    # Double censored distributions for each epidemic phase\n    for row in eachrow(scenarios_df)\n        y_double = cdf.(row.double_censored_dist, x_delay_d)\n        plot!(p4, x_delay_d, y_double,\n            label = \"$(row.name) Double (r=$(row.r))\",\n            color = row.color, linewidth = 2, linestyle = :solid)\n    end\n\n    p4\nend</code></pre>\n<img src=\"data:image/svg+xml;base64,\"/>\n\n\n<div class=\"markdown\"><h2 id=\"Key-Insights\">Key Insights</h2><ol><li><p><strong>Primary event bias is distinct from truncation bias:</strong></p><ul><li><p>Occurs regardless of the primary event distribution but is more complex when the primary event distribution is non-uniform.</p></li><li><p>Growth phase: Recent primary events over-represented → shorter observed delays</p></li><li><p>Decline phase: Older primary events more represented → longer observed delays</p></li></ul></li><li><p><strong>Two key factors control bias magnitude:</strong></p><ul><li><p><strong>Growth rate magnitude</strong>: Stronger growth (larger |r|) creates more divergence from the uniform case</p></li><li><p><strong>Window length</strong>: Longer windows increases divergence for same growth rate</p></li></ul></li><li><p><strong>When to use <code>ExponentiallyTilted</code>:</strong></p><ul><li><p>Most important when primary censoring intervals are wide (multi-day windows)</p></li><li><p>For daily primary censoring and moderate epidemic growth, Uniform distributions are often a reasonable approximation</p></li><li><p>Key benefit of Uniform: Analytical solutions available that are much faster computationally</p></li><li><p>Use <code>ExponentiallyTilted</code> when precision is critical, the computational cost is acceptable, and the growth rate is relatively well known.</p></li></ul></li></ol><h2 id=\"References\">References</h2><ul><li><p>Park et al. (2024): \"Estimating epidemiological delay distributions for infectious diseases\"</p></li><li><p>Charniga et al. (2024): \"Primary event censoring in infectious disease surveillance\"</p></li><li><p><a href=\"https://nfidd.github.io/sismid/sessions/biases-in-delay-distributions.html\">SISMID Tutorial</a>: Interactive bias demonstrations</p></li></ul></div>\n\n<!-- PlutoStaticHTML.End -->","category":"page"},{"location":"getting-started/tutorials/analytical-primarycensored-cdfs/","page":"Analytical CDF Solutions","title":"Analytical CDF Solutions","text":"<style>\n    #documenter-page table {\n        display: table !important;\n        margin: 2rem auto !important;\n        border-top: 2pt solid rgba(0,0,0,0.2);\n        border-bottom: 2pt solid rgba(0,0,0,0.2);\n    }\n\n    #documenter-page pre, #documenter-page div {\n        margin-top: 1.4rem !important;\n        margin-bottom: 1.4rem !important;\n    }\n\n    .code-output {\n        padding: 0.7rem 0.5rem !important;\n    }\n\n    .admonition-body {\n        padding: 0em 1.25em !important;\n    }\n</style>\n\n<!-- PlutoStaticHTML.Begin -->\n<!--\n    # This information is used for caching.\n    [PlutoStaticHTML.State]\n    input_sha = \"b3be950dcd9150e4c25d966b4df655a604fbf4ab49b523490222e5d5ae346588\"\n    julia_version = \"1.11.7\"\n-->\n\n<div class=\"markdown\"><h1 id=\"Analytical-CDF-Solutions-for-Primary-Censored-Distributions\">Analytical CDF Solutions for Primary Censored Distributions</h1><p>This tutorial demonstrates the analytical CDF solutions available in CensoredDistributions.jl. These analytical solutions provide significant performance improvements over numerical integration while maintaining machine precision accuracy.</p><h2 id=\"Overview\">Overview</h2><p>Primary event censoring occurs when the exact time of an initiating event is unknown but falls within a known window. The observed time is the sum of:</p><ol><li><p>The primary event time (uncertain, within a window)</p></li><li><p>A delay from the primary event to observation</p></li></ol><p>CensoredDistributions.jl provides analytical solutions for certain distribution combinations, automatically using them when available for optimal performance.</p></div>\n\n\n<div class=\"markdown\"><h2 id=\"Currently-Supported-Analytical-Solutions\">Currently Supported Analytical Solutions</h2><table><tbody><tr><th align=\"right\">Delay Distribution</th><th align=\"right\">Primary Distribution</th><th align=\"right\">Status</th></tr><tr><td align=\"right\">Gamma</td><td align=\"right\">Uniform</td><td align=\"right\">✅ Analytical</td></tr><tr><td align=\"right\">LogNormal</td><td align=\"right\">Uniform</td><td align=\"right\">✅ Analytical</td></tr><tr><td align=\"right\">Weibull</td><td align=\"right\">Uniform</td><td align=\"right\">✅ Analytical</td></tr><tr><td align=\"right\">Others</td><td align=\"right\">Any</td><td align=\"right\">🔢 Numerical</td></tr></tbody></table><p>These analytical solutions are based on the mathematical derivations implemented in the <a href=\"https://primarycensored.epinowcast.org/\">primarycensored R package</a>, with detailed mathematical formulations available in their <a href=\"https://primarycensored.epinowcast.org/articles/analytic-solutions.html\">analytical solutions vignette</a>.</p></div>\n\n\n<div class=\"markdown\"></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    using CensoredDistributions\n    using Distributions\n    using BenchmarkTools\n    using Plots\n    using StatsPlots\n    using DataFramesMeta\n    using Printf\n    using Integrals\nend</code></pre>\n\n\n\n<div class=\"markdown\"><h2 id=\"Automatic-Method-Selection\">Automatic Method Selection</h2><p>CensoredDistributions.jl automatically selects the appropriate method:</p><ul><li><p><strong>Analytical</strong> solutions when available (optimal performance)</p></li><li><p><strong>Numerical</strong> integration as fallback</p></li></ul><p>Let's see this in action with a Gamma distribution:</p></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    # Create a Gamma distribution for delays\n    gamma_delay = Gamma(2.0, 3.0)\n\n    # Primary event window (uniform over 1 day)\n    primary_uniform = Uniform(0.0, 1.0)\n\n    # Default: uses analytical solution for Gamma\n    pc_gamma_analytical = primary_censored(gamma_delay, primary_uniform)\n\n    # Force numerical integration\n    pc_gamma_numerical = primary_censored(\n        gamma_delay, primary_uniform; force_numeric = true)\n\n    # Store solver types for display\n    solver_types = (\n        analytical = typeof(pc_gamma_analytical.method),\n        numerical = typeof(pc_gamma_numerical.method)\n    );\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-gamma_delay\">(analytical = CensoredDistributions.AnalyticalSolver{QuadGKJL{typeof(LinearAlgebra.norm), Nothing}}, numerical = CensoredDistributions.NumericSolver{QuadGKJL{typeof(LinearAlgebra.norm), Nothing}})</pre>\n\n\n<div class=\"markdown\"><p>Let's verify both methods give the same results:</p></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    x_compare = 0:0.5:10\n    cdf_analytical_vals = cdf.(pc_gamma_analytical, x_compare)\n    cdf_numerical_vals = cdf.(pc_gamma_numerical, x_compare)\n\n    plot(x_compare, cdf_analytical_vals,\n        label = \"Analytical\", linewidth = 3, color = :blue,\n        title = \"CDF Comparison: Analytical vs Numerical\",\n        xlabel = \"x\", ylabel = \"CDF\")\n    plot!(x_compare, cdf_numerical_vals,\n        label = \"Numerical\", linewidth = 2, linestyle = :dash, color = :red)\nend</code></pre>\n<img src=\"data:image/svg+xml;base64,\"/>\n\n\n<div class=\"markdown\"><h2 id=\"Performance-Comparison\">Performance Comparison</h2><p>Let's benchmark the performance difference between analytical and numerical methods:</p></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    # Create distributions for benchmarking\n    lognormal_delay = LogNormal(1.5, 0.75)\n    weibull_delay = Weibull(2.0, 1.5)\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-lognormal_delay\">Distributions.Weibull{Float64}(α=2.0, θ=1.5)</pre>\n\n<pre class='language-julia'><code class='language-julia'>function benchmark_cdf_methods(\n        dist, primary, name; x_values = [0.5, 1.0, 2.0, 5.0, 10.0, 20.0])\n    # Create both versions\n    d_analytical = primary_censored(dist, primary)\n    d_numerical = primary_censored(dist, primary; force_numeric = true)\n\n    # Benchmark at multiple x values\n    speedups = Float64[]\n    analytical_times = Float64[]\n    numerical_times = Float64[]\n\n    for x in x_values\n        bench_analytical = @benchmark cdf($d_analytical, $x) samples=100\n        bench_numerical = @benchmark cdf($d_numerical, $x) samples=100\n\n        # Extract times in microseconds\n        time_analytical = median(bench_analytical).time / 1000\n        time_numerical = median(bench_numerical).time / 1000\n\n        push!(analytical_times, time_analytical)\n        push!(numerical_times, time_numerical)\n        push!(speedups, time_numerical / time_analytical)\n    end\n\n    return (\n        name = name,\n        x_values = x_values,\n        analytical_μs = analytical_times,\n        numerical_μs = numerical_times,\n        speedups = speedups,\n        mean_speedup = mean(speedups),\n        median_speedup = median(speedups),\n        min_speedup = minimum(speedups),\n        max_speedup = maximum(speedups)\n    )\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-benchmark_cdf_methods\">benchmark_cdf_methods (generic function with 1 method)</pre>\n\n<pre class='language-julia'><code class='language-julia'># Run benchmarks for all supported distributions\nbenchmark_results = [\n    benchmark_cdf_methods(gamma_delay, primary_uniform, \"Gamma\"),\n    benchmark_cdf_methods(lognormal_delay, primary_uniform, \"LogNormal\"),\n    benchmark_cdf_methods(weibull_delay, primary_uniform, \"Weibull\")\n];</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'># Create performance comparison plots\nbegin\n    # Summary statistics plot\n    dist_names = [r.name for r in benchmark_results]\n    mean_speedups = [r.mean_speedup for r in benchmark_results]\n    min_speedups = [r.min_speedup for r in benchmark_results]\n    max_speedups = [r.max_speedup for r in benchmark_results]\n\n    p1 = bar(\n        dist_names,\n        mean_speedups,\n        ylabel = \"Speedup Factor\",\n        title = \"Mean Performance Improvement Across Different x Values\",\n        color = :blue,\n        legend = false,\n        yerror = (mean_speedups .- min_speedups, max_speedups .- mean_speedups)\n    )\n\n    # Add speedup text on bars\n    for (i, speedup) in enumerate(mean_speedups)\n        annotate!(p1, i, speedup + 5, text(@sprintf(\"%.0fx\", speedup), :center, 10))\n    end\n\n    # Detailed speedup by x value\n    p2 = plot(\n        title = \"Speedup Factor by x Value\",\n        xlabel = \"x\",\n        ylabel = \"Speedup Factor\",\n        legend = :topright,\n        xscale = :log10\n    )\n\n    colors = [:blue, :red, :green]\n    for (i, result) in enumerate(benchmark_results)\n        plot!(p2, result.x_values, result.speedups,\n            label = result.name,\n            color = colors[i],\n            marker = :circle,\n            markersize = 4,\n            linewidth = 2)\n    end\n\n    # Computation time comparison\n    p3 = plot(\n        title = \"Computation Time Comparison\",\n        xlabel = \"x\",\n        ylabel = \"Time (microseconds)\",\n        legend = :topleft,\n        xscale = :log10,\n        yscale = :log10\n    )\n\n    for (i, result) in enumerate(benchmark_results)\n        plot!(p3, result.x_values, result.analytical_μs,\n            label = result.name * \" (Analytical)\",\n            color = colors[i],\n            linestyle = :solid,\n            marker = :circle,\n            markersize = 3,\n            linewidth = 2)\n        plot!(p3, result.x_values, result.numerical_μs,\n            label = result.name * \" (Numerical)\",\n            color = colors[i],\n            linestyle = :dash,\n            marker = :square,\n            markersize = 3,\n            linewidth = 2)\n    end\n\n    plot(p1, p2, p3, layout = (3, 1), size = (700, 900))\nend</code></pre>\n<img src=\"data:image/svg+xml;base64,\"/>\n\n\n<div class=\"markdown\"><h2 id=\"Accuracy-Verification\">Accuracy Verification</h2><p>The analytical solutions maintain machine precision accuracy. Let's verify this:</p></div>\n\n<pre class='language-julia'><code class='language-julia'>function compare_accuracy(dist, primary, name, x_range)\n    d_analytical = primary_censored(dist, primary)\n    d_numerical = primary_censored(dist, primary; force_numeric = true)\n\n    # Compute CDFs\n    cdf_analytical = [cdf(d_analytical, x) for x in x_range]\n    cdf_numerical = [cdf(d_numerical, x) for x in x_range]\n\n    # Compute absolute errors\n    abs_errors = abs.(cdf_analytical .- cdf_numerical)\n\n    return (\n        name = name,\n        x = x_range,\n        analytical = cdf_analytical,\n        numerical = cdf_numerical,\n        errors = abs_errors,\n        max_error = maximum(abs_errors)\n    )\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-compare_accuracy\">compare_accuracy (generic function with 1 method)</pre>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    x_test = range(0.1, 20, length = 100)\n\n    accuracy_gamma = compare_accuracy(gamma_delay, primary_uniform, \"Gamma\", x_test)\n    accuracy_lognormal = compare_accuracy(\n        lognormal_delay, primary_uniform, \"LogNormal\", x_test)\n    accuracy_weibull = compare_accuracy(weibull_delay, primary_uniform, \"Weibull\", x_test)\n\n    # Store accuracy results for display\n    max_errors = (\n        gamma = accuracy_gamma.max_error,\n        lognormal = accuracy_lognormal.max_error,\n        weibull = accuracy_weibull.max_error\n    );\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-accuracy_lognormal\">(gamma = 1.0769163338864018e-13, lognormal = 1.700462687326265e-14, weibull = 4.987121826616203e-13)</pre>\n\n<pre class='language-julia'><code class='language-julia'># Plot CDF comparison\nbegin\n    p_cdf = plot(\n        title = \"CDF Comparison: Analytical vs Numerical\",\n        xlabel = \"x\",\n        ylabel = \"CDF\",\n        legend = :bottomright\n    )\n\n    # Plot CDFs (they overlap perfectly)\n    plot!(p_cdf, accuracy_gamma.x, accuracy_gamma.analytical,\n        label = \"Gamma (both methods)\", color = :blue, linewidth = 2)\n    plot!(p_cdf, accuracy_lognormal.x, accuracy_lognormal.analytical,\n        label = \"LogNormal (both methods)\", color = :red, linewidth = 2)\n    plot!(p_cdf, accuracy_weibull.x, accuracy_weibull.analytical,\n        label = \"Weibull (both methods)\", color = :green, linewidth = 2)\n\n    # Error plot\n    p_error = plot(\n        title = \"Absolute Error: |Analytical - Numerical|\",\n        xlabel = \"x\",\n        ylabel = \"Absolute Error\",\n        yscale = :log10,\n        legend = :topright,\n        ylims = (1e-17, 1e-13)\n    )\n\n    plot!(p_error, accuracy_gamma.x, accuracy_gamma.errors .+ 1e-17,\n        label = \"Gamma\", color = :blue, linewidth = 2)\n    plot!(p_error, accuracy_lognormal.x, accuracy_lognormal.errors .+ 1e-17,\n        label = \"LogNormal\", color = :red, linewidth = 2)\n    plot!(p_error, accuracy_weibull.x, accuracy_weibull.errors .+ 1e-17,\n        label = \"Weibull\", color = :green, linewidth = 2)\n\n    plot(p_cdf, p_error, layout = (2, 1), size = (700, 600))\nend</code></pre>\n<img src=\"data:image/svg+xml;base64,\"/>\n\n\n<div class=\"markdown\"><h2 id=\"Exploring-Available-Methods\">Exploring Available Methods</h2><p>You can use Julia's <code>methods</code> function to discover which distribution combinations have analytical solutions:</p></div>\n\n<pre class='language-julia'><code class='language-julia'># Find all analytical CDF implementations\nanalytical_methods = methods(CensoredDistributions.primarycensored_cdf,\n    (Any, Any, Real, CensoredDistributions.AnalyticalSolver));</code></pre>\n\n\n\n<div class=\"markdown\"><p>The above shows all methods defined for <code>primarycensored_cdf</code> with an <code>AnalyticalSolver</code>. Each method signature shows which distribution combinations have analytical solutions implemented.</p></div>\n\n\n<div class=\"markdown\"><h2 id=\"Custom-Solver-Options\">Custom Solver Options</h2><p>You can also customise the numerical solver when needed:</p></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    # Create an exponential distribution (no analytical solution available)\n    exponential_delay = Exponential(2.0)\n\n    # Default solver (QuadGKJL)\n    pc_default = primary_censored(exponential_delay, primary_uniform)\n\n    # Custom solver (HCubatureJL for multidimensional problems)\n    pc_custom = primary_censored(exponential_delay, primary_uniform;\n        solver = HCubatureJL())\n\n    # Even with analytical solutions available, you can specify a custom solver\n    # (it will be used if you force numeric or for distributions without analytical solutions)\n    pc_gamma_custom = primary_censored(gamma_delay, primary_uniform;\n        solver = HCubatureJL())\n\n    # Store solver information for display\n    solver_info = (\n        default = typeof(pc_default.method.solver),\n        custom = typeof(pc_custom.method.solver)\n    );\nend</code></pre>\n<pre class=\"code-output documenter-example-output\" id=\"var-pc_custom\">(default = QuadGKJL{typeof(LinearAlgebra.norm), Nothing}, custom = HCubatureJL{typeof(LinearAlgebra.norm), Nothing})</pre>\n\n\n<div class=\"markdown\"><h2 id=\"Implementing-New-Analytical-Solutions\">Implementing New Analytical Solutions</h2><p>If you have derived an analytical solution for a new distribution combination, you can extend the package by defining a new method for <code>primarycensored_cdf</code>. The key steps are:</p><ol><li><p><strong>Derive the mathematical formula</strong> following the methodology in the <a href=\"https://primarycensored.epinowcast.org/articles/analytic-solutions.html\">primarycensored R package vignette</a></p></li><li><p><strong>Define a new method</strong> for the specific distribution types making sure to define it for the <code>AnalyticalSolver</code> method.</p></li><li><p><strong>Use log-space computations</strong> with LogExpFunctions.jl for numerical stability</p></li><li><p><strong>Test thoroughly</strong> against numerical integration</p></li></ol><p>For detailed implementation guidance, see the existing implementations in the source code at <code>src/censoring/primarycensored_cdf.jl</code>.</p></div>\n\n\n<div class=\"markdown\"><h2 id=\"Summary\">Summary</h2><p>The analytical CDF solutions in CensoredDistributions.jl provide:</p><ol><li><p><strong>Automatic optimization</strong>: The package automatically uses analytical solutions when available</p></li><li><p><strong>Significant speedup</strong>: 15-100x performance improvement over numerical integration</p></li><li><p><strong>Machine precision accuracy</strong>: Errors typically &lt; 1e-15</p></li><li><p><strong>Seamless integration</strong>: Same API whether using analytical or numerical methods</p></li><li><p><strong>Flexibility</strong>: Can force numerical methods or use custom solvers when needed</p></li></ol><h3 id=\"References\">References</h3><ul><li><p><a href=\"https://primarycensored.epinowcast.org/\">primarycensored R package</a>: Reference implementation with mathematical derivations</p></li><li><p><a href=\"https://primarycensored.epinowcast.org/articles/analytic-solutions.html\">Analytical solutions vignette</a>: Detailed mathematical formulations</p></li><li><p>Park et al. (2024) and Cori et al. (2013): Original research papers</p></li></ul></div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    let\n        docs_dir = (dirname ∘ dirname ∘ dirname)(@__DIR__)\n        using Pkg: Pkg\n        Pkg.activate(docs_dir)\n        Pkg.instantiate()\n    end\nend</code></pre>\n\n\n<!-- PlutoStaticHTML.End -->","category":"page"},{"location":"developer/faq/#developer-faq","page":"Developer FAQ","title":"Developer FAQ","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"This page contains frequently asked questions for developers and contributors to CensoredDistributions.jl.","category":"page"},{"location":"developer/faq/#Development-Environment","page":"Developer FAQ","title":"Development Environment","text":"","category":"section"},{"location":"developer/faq/#Q:-My-code-changes-aren't-reflecting-when-developing","page":"Developer FAQ","title":"Q: My code changes aren't reflecting when developing","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: Install and use Revise.jl for automatic code reloading:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"using Pkg\nPkg.add(\"Revise\")          # Install once\nusing Revise               # Load before your package\nusing CensoredDistributions # Now changes reload automatically","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"Better yet, add Revise to your startup.jl file as described in the Julia setup guide.","category":"page"},{"location":"developer/faq/#Q:-I-get-\"Package-not-found\"-errors-during-development","page":"Developer FAQ","title":"Q: I get \"Package not found\" errors during development","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: Make sure you're in the right environment:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"using Pkg\nPkg.activate(\".\")           # Activate current directory\nPkg.instantiate()           # Install dependencies\nPkg.develop(PackageSpec(path=\".\"))  # Add local package in dev mode","category":"page"},{"location":"developer/faq/#Testing","page":"Developer FAQ","title":"Testing","text":"","category":"section"},{"location":"developer/faq/#Q:-Tests-are-failing-or-taking-too-long","page":"Developer FAQ","title":"Q: Tests are failing or taking too long","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: For development, you can skip quality tests:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"julia --project=test test/runtests.jl skip_quality","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"This runs core functionality tests without slow formatting/linting checks.","category":"page"},{"location":"developer/faq/#Q:-How-do-I-run-specific-tests?","page":"Developer FAQ","title":"Q: How do I run specific tests?","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: Use TestItemRunner for targeted testing:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"using TestItemRunner\n# Run tests for specific components\nrun_tests(\"test/censoring/\")\n# Run tests with specific tags\nrun_tests(filter=ti->(:unit in ti.tags))","category":"page"},{"location":"developer/faq/#Q:-How-do-I-add-new-tests?","page":"Developer FAQ","title":"Q: How do I add new tests?","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: Create tests using the @testitem macro:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"@testitem \"My new feature\" tags=[:unit] begin\n    using CensoredDistributions, Distributions\n\n    # Test your feature\n    result = my_new_function()\n    @test result isa SomeType\nend","category":"page"},{"location":"developer/faq/#Documentation","page":"Developer FAQ","title":"Documentation","text":"","category":"section"},{"location":"developer/faq/#Q:-How-do-I-build-the-documentation-locally?","page":"Developer FAQ","title":"Q: How do I build the documentation locally?","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: Use the documentation environment:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"# Full build (includes Pluto notebook processing - slow)\njulia --project=docs docs/make.jl\n\n# Fast build for development (skips notebook processing)\njulia --project=docs docs/make.jl --skip-notebooks\n\n# Alternative: use environment variable\nSKIP_NOTEBOOKS=true julia --project=docs docs/make.jl","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"The --skip-notebooks option is useful during development for quick documentation checks without waiting for slow Pluto notebook processing.","category":"page"},{"location":"developer/faq/#Q:-How-do-I-add-a-new-Pluto-notebook-tutorial?","page":"Developer FAQ","title":"Q: How do I add a new Pluto notebook tutorial?","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"Create the .jl notebook in docs/src/getting-started/tutorials/\nAdd a build(\"getting-started/tutorials\") call in docs/make.jl if not already present\nAdd the generated .md file path to docs/pages.jl","category":"page"},{"location":"developer/faq/#Q:-How-do-I-update-docstrings?","page":"Developer FAQ","title":"Q: How do I update docstrings?","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: We use DocStringExtensions.jl for automatic documentation generation. The approach depends on content:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"For docstrings with DocStringExtensions macros only:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"@doc \"\n$(TYPEDSIGNATURES)\n\nCompute the square of `x`.\n\n# See also\n- [`sqrt`](@ref): Inverse operation\n\"\nfunction my_function(x::Real)\n    return x^2\nend","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"For docstrings with both macros and LaTeX math:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"@doc \"\"\"\n$(TYPEDSIGNATURES)\n\nCompute the function ``f(x) = x^2``.\n\n# Mathematical formulation\nThe function computes: ``f(x) = x^2``\n\"\"\"\nfunction my_function(x::Real)\n    return x^2\nend","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"Important: Never use @doc raw\" with DocStringExtensions macros as it prevents macro expansion.","category":"page"},{"location":"developer/faq/#Code-Quality","page":"Developer FAQ","title":"Code Quality","text":"","category":"section"},{"location":"developer/faq/#Q:-How-do-I-run-code-quality-checks?","page":"Developer FAQ","title":"Q: How do I run code quality checks?","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: Quality tests are included in the main test suite:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"julia --project=. -e 'using Pkg; Pkg.test()'","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"Individual quality tests can be found in test/package/.","category":"page"},{"location":"developer/faq/#Q:-My-code-doesn't-pass-formatting-checks","page":"Developer FAQ","title":"Q: My code doesn't pass formatting checks","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: The project uses automatic formatting. Check the pre-commit hooks or run formatting tools as specified in the contributing guide.","category":"page"},{"location":"developer/faq/#Q:-How-do-I-check-for-type-stability?","page":"Developer FAQ","title":"Q: How do I check for type stability?","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: Use JET.jl for static analysis:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"using JET\n# Check specific function\n@report_opt primary_censored(Gamma(2, 1), Uniform(0, 1))\n# Check entire package\n@report_package CensoredDistributions","category":"page"},{"location":"developer/faq/#Performance","page":"Developer FAQ","title":"Performance","text":"","category":"section"},{"location":"developer/faq/#Q:-How-do-I-benchmark-my-changes?","page":"Developer FAQ","title":"Q: How do I benchmark my changes?","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: Use BenchmarkTools.jl:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"using BenchmarkTools\npc = primary_censored(Gamma(2, 1), Uniform(0, 1))\n@benchmark cdf(pc, 5.0)","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"For comprehensive benchmarking:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"julia --project=benchmark benchmark/runbenchmarks.jl","category":"page"},{"location":"developer/faq/#Q:-How-do-I-add-analytical-solutions-for-new-distribution-pairs?","page":"Developer FAQ","title":"Q: How do I add analytical solutions for new distribution pairs?","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: See the Analytical CDF Solutions tutorial in the tutorials section for implementation patterns. Add methods to the appropriate files in src/censoring/ and ensure they're properly tested.","category":"page"},{"location":"developer/faq/#Contributing","page":"Developer FAQ","title":"Contributing","text":"","category":"section"},{"location":"developer/faq/#Q:-How-can-I-contribute-to-the-package?","page":"Developer FAQ","title":"Q: How can I contribute to the package?","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: See our Contributing Guide for details on setting up the development environment, running tests, code style guidelines, and submitting pull requests.","category":"page"},{"location":"developer/faq/#Q:-I-found-a-bug-or-have-a-feature-request","page":"Developer FAQ","title":"Q: I found a bug or have a feature request","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"Bugs: File a GitHub issue with a minimal reproducible example\nFeature requests: Open a GitHub issue with rationale and use case\nQuestions: Use GitHub Discussions for broader questions","category":"page"},{"location":"developer/faq/#Q:-How-do-I-submit-a-pull-request?","page":"Developer FAQ","title":"Q: How do I submit a pull request?","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"Fork the repository\nCreate a feature branch\nMake your changes with tests\nRun the full test suite: julia --project=. -e 'using Pkg; Pkg.test()'\nBuild documentation: julia --project=docs docs/make.jl\nSubmit a pull request with a clear description","category":"page"},{"location":"developer/faq/#Q:-What-should-I-include-in-my-pull-request?","page":"Developer FAQ","title":"Q: What should I include in my pull request?","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"Clear description of changes and motivation\nTests for new functionality\nDocumentation updates if needed\nEnsure all CI checks pass","category":"page"},{"location":"developer/faq/#Troubleshooting","page":"Developer FAQ","title":"Troubleshooting","text":"","category":"section"},{"location":"developer/faq/#Q:-The-documentation-build-is-failing","page":"Developer FAQ","title":"Q: The documentation build is failing","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A: Common issues:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"Check that all cross-references are valid\nEnsure Pluto notebooks run without errors\nVerify all @example blocks execute successfully\nCheck for missing dependencies in docs/Project.toml","category":"page"},{"location":"developer/faq/#Q:-Pluto-notebooks-won't-start","page":"Developer FAQ","title":"Q: Pluto notebooks won't start","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"Ensure you're using the docs environment: julia --project=docs\nCheck that Pluto is installed: ] add Pluto\nTry the shell script: docs/pluto-scripts.sh","category":"page"},{"location":"developer/faq/#Q:-I'm-getting-precompilation-errors","page":"Developer FAQ","title":"Q: I'm getting precompilation errors","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"A:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"Clear compiled cache: julia -e 'using Pkg; Pkg.precompile()'\nReset environments: remove Manifest.toml and run ] instantiate\nCheck for version conflicts: ] resolve","category":"page"},{"location":"developer/faq/#Getting-Help","page":"Developer FAQ","title":"Getting Help","text":"","category":"section"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"For development-specific questions:","category":"page"},{"location":"developer/faq/","page":"Developer FAQ","title":"Developer FAQ","text":"Code issues: Open a GitHub Discussion\nBug reports: GitHub Issues\nGeneral Julia development: Julia Discourse","category":"page"},{"location":"developer/contributing/#contributing","page":"Contributing","title":"Contributing","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"This page details the guidelines that should be followed when contributing to CensoredDistributions.jl.","category":"page"},{"location":"developer/contributing/#Getting-Started","page":"Contributing","title":"Getting Started","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Before contributing, please:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Read the Getting Started with Julia guide if you're new to Julia development\nInstall Task for streamlined development workflows:\nmacOS: brew install go-task/tap/go-task\nLinux: Download from releases or use package manager\nWindows: winget install Task.Task or download from releases\nCheck out the developer documentation for advanced workflows\nReview the project structure and development commands below","category":"page"},{"location":"developer/contributing/#Project-Structure","page":"Contributing","title":"Project Structure","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"CensoredDistributions.jl uses multiple environments for different purposes:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"CensoredDistributions.jl/\n├── Project.toml           # Main package environment\n├── test/\n│   ├── Project.toml       # Test environment with test dependencies\n│   ├── runtests.jl        # Main test entry point\n│   ├── censoring/         # Feature-specific tests\n│   └── package/           # Quality tests (Aqua, DocTest, etc.)\n├── docs/\n│   ├── Project.toml       # Documentation environment\n│   ├── make.jl           # Documentation build script\n│   ├── pages.jl          # Documentation structure\n│   └── src/              # Documentation source files\n└── benchmark/\n    ├── Project.toml       # Benchmark environment\n    └── runbenchmarks.jl   # Benchmark suite","category":"page"},{"location":"developer/contributing/#Development-Commands","page":"Contributing","title":"Development Commands","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"This project includes a Taskfile for streamlined development workflows.","category":"page"},{"location":"developer/contributing/#Quick-Start-with-Tasks","page":"Contributing","title":"Quick Start with Tasks","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"# Discover all available tasks\ntask --list\n\n# Common development workflow\ntask setup     # One-time environment setup\ntask dev       # Fast tests + documentation\ntask precommit # Pre-commit validation\n\n# Individual workflows\ntask test-fast    # Quick testing\ntask docs-pluto   # Start Pluto notebook server\ntask benchmark    # Run benchmarks","category":"page"},{"location":"developer/contributing/#Detailed-Commands","page":"Contributing","title":"Detailed Commands","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"For advanced usage or when tasks don't cover specific needs, use the underlying Julia commands:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"# Full test suite (recommended for CI and final checks)\njulia --project=. -e 'using Pkg; Pkg.test()'\n\n# Run tests directly (faster during development)\njulia --project=test test/runtests.jl\n\n# Skip quality tests for faster development iteration\njulia --project=test test/runtests.jl skip_quality\n\n# Build complete documentation (includes Pluto notebook conversion)\njulia --project=docs docs/make.jl\n\n# Execute benchmark suite\njulia --project=benchmark benchmark/runbenchmarks.jl","category":"page"},{"location":"developer/contributing/#Testing-Strategy","page":"Contributing","title":"Testing Strategy","text":"","category":"section"},{"location":"developer/contributing/#Test-Organisation","page":"Contributing","title":"Test Organisation","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Unit tests: Located in test/censoring/ for each distribution type\nIntegration tests: Test interactions between components\nQuality tests: Located in test/package/ including:\nAqua.jl for code quality\nDocTest.jl for documentation examples\nCode formatting and linting checks","category":"page"},{"location":"developer/contributing/#Test-Environment","page":"Contributing","title":"Test Environment","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"The test environment (test/Project.toml) includes:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Test-specific dependencies (TestItemRunner.jl, Test.jl)\nThe main package in development mode\nQuality assurance tools","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Use skip_quality argument during development to bypass slow quality checks:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"julia --project=test test/runtests.jl skip_quality","category":"page"},{"location":"developer/contributing/#Documentation","page":"Contributing","title":"Documentation","text":"","category":"section"},{"location":"developer/contributing/#Pluto-Notebooks","page":"Contributing","title":"Pluto Notebooks","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"The tutorials use Pluto.jl notebooks located in docs/src/getting-started/tutorials/. These are converted to markdown during the documentation build.","category":"page"},{"location":"developer/contributing/#Working-with-Pluto-notebooks","page":"Contributing","title":"Working with Pluto notebooks","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Start Pluto: Use the task command:\ntask docs-pluto\nEnvironment setup: Notebooks should use the docs environment and develop the local package:\n# In notebook setup cell\nlet\n    docs_dir = (dirname ∘ dirname ∘ dirname)(@__DIR__)\n    using Pkg: Pkg\n    Pkg.activate(docs_dir)\n    Pkg.develop(PackageSpec(path=dirname(docs_dir)))\n    Pkg.instantiate()\nend\nAdding new notebooks:\nAdd the notebook file to docs/src/getting-started/tutorials/\nAdd build call in docs/make.jl\nAdd the generated .md file to docs/pages.jl","category":"page"},{"location":"developer/contributing/#Documentation-Structure","page":"Contributing","title":"Documentation Structure","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"docs/src/getting-started/: User-facing documentation\ndocs/src/lib/: API documentation (auto-generated)\ndocs/src/developer/: Developer and contributor documentation","category":"page"},{"location":"developer/contributing/#Branches-and-Workflow","page":"Contributing","title":"Branches and Workflow","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Feature branches: Create feature branches for new development\nMain branch: Features are merged into main when ready\nReleases: Automatic releases are created when versions are tagged","category":"page"},{"location":"developer/contributing/#Style-Guide","page":"Contributing","title":"Style Guide","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"This project follows the SciML style guide.","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Key points:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Use descriptive variable names\nFollow Julia naming conventions (snake_case for variables, CamelCase for types)\nWrite docstrings for exported functions\nKeep lines under 80 characters where possible\nUse consistent indentation (4 spaces)","category":"page"},{"location":"developer/contributing/#Documentation-Standards","page":"Contributing","title":"Documentation Standards","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"All docstrings use the DocStringExtensions.jl template system defined in src/docstrings.jl:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Functions: Use $(TYPEDSIGNATURES) for automatic signature generation:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"@doc \"\n$(TYPEDSIGNATURES)\n\nBrief description of the function.\n\n# Arguments\n- `param1`: Description (no type annotations needed)\n- `param2`: Description\n\n# Keyword Arguments\n- `kwarg1`: Description\n\"\nfunction my_function(param1, param2; kwarg1=default)\n    # implementation\nend","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Structs: Use $(TYPEDEF) and $(TYPEDFIELDS) with inline field documentation:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"@doc \"\n$(TYPEDEF)\n\nDescription of the struct.\n\n$(TYPEDFIELDS)\n\"\nstruct MyStruct\n    \"Description of field1\"\n    field1::Type1\n    \"Description of field2\"\n    field2::Type2\nend","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Key rules:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Never use @doc raw\" - it bypasses the template system\nDon't repeat type information in argument descriptions since $(TYPEDSIGNATURES) shows them\nUse @doc \" (not @doc \"\"\") to allow macro expansion\nDocument argument purpose, not types","category":"page"},{"location":"developer/contributing/#Code-Quality","page":"Contributing","title":"Code Quality","text":"","category":"section"},{"location":"developer/contributing/#Pre-commit-Checklist","page":"Contributing","title":"Pre-commit Checklist","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Before submitting a pull request:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Run pre-commit checks (recommended):\ntask precommit\nOr run individual checks:\ntask test       # Full test suite\ntask docs-fast  # Build documentation","category":"page"},{"location":"developer/contributing/#Quality-Tools","page":"Contributing","title":"Quality Tools","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"The project includes several quality assurance tools:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Aqua.jl: Checks for common package issues\nJET.jl: Static analysis for type stability (available in developer environment)\nDocTest.jl: Ensures documentation examples work","category":"page"},{"location":"developer/contributing/#Adding-New-Features","page":"Contributing","title":"Adding New Features","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Write tests first: Add tests in appropriate test/ subdirectory\nImplement feature: Add implementation in src/\nDocument feature: Add docstrings and update documentation if needed\nTest thoroughly: Run full test suite\nUpdate changelog: Add entry describing the change","category":"page"},{"location":"developer/contributing/#Advanced-Development-Resources","page":"Contributing","title":"Advanced Development Resources","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"For advanced Julia development techniques beyond this project:","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Julia Performance Tips: Official performance optimization guide\nJET.jl: Static analysis for type stability and optimization\nProfileView.jl: Visual profiling for performance analysis\nPkgTemplates.jl: Best practices for Julia package structure","category":"page"},{"location":"developer/contributing/#Getting-Help","page":"Contributing","title":"Getting Help","text":"","category":"section"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Questions: Open a GitHub discussion\nBugs: File a GitHub issue with minimal reproducible example\nFeature requests: Open a GitHub issue with rationale and use case\nGeneral Julia help: See Julia Discourse or Julia Slack","category":"page"},{"location":"developer/contributing/","page":"Contributing","title":"Contributing","text":"Thank you for contributing to CensoredDistributions.jl!","category":"page"},{"location":"developer/release-process/#release-process","page":"Release Process","title":"Release Process","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"CensoredDistributions.jl follows a hybrid approach to release documentation, combining the Julia ecosystem's standard practices with a news file for major releases.","category":"page"},{"location":"developer/release-process/#Release-Philosophy","page":"Release Process","title":"Release Philosophy","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Release frequently: Ideally after every merged PR to main.\nSemantic versioning: Follow SemVer strictly\nHybrid changelog approach: Use NEWS.md for major releases, GitHub releases for all releases\nAutomated tooling: Leverage standard Julia ecosystem tools\nSciML ecosystem alignment: Follow established patterns from the broader scientific computing ecosystem","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"When NOT to release:","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Work-in-progress features\nFailing tests\nIncomplete documentation for new features\nDuring Julia ecosystem-wide changes (wait for stability)","category":"page"},{"location":"developer/release-process/#Release-Workflow","page":"Release Process","title":"Release Workflow","text":"","category":"section"},{"location":"developer/release-process/#1.-Standard-Julia-Tooling","page":"Release Process","title":"1. Standard Julia Tooling","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"We use the same tools as major Julia packages:","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"CompatHelper: Automated dependency updates via daily PRs\n@JuliaRegistrator: Manual package registration to Julia General Registry\nTagBot: Automated GitHub release creation after registry registration","category":"page"},{"location":"developer/release-process/#2.-Release-Steps","page":"Release Process","title":"2. Release Steps","text":"","category":"section"},{"location":"developer/release-process/#For-Regular-Releases-(Patch/Minor)","page":"Release Process","title":"For Regular Releases (Patch/Minor)","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Ensure all tests pass and pre-commit hooks are clean\nUpdate version in Project.toml:\nversion = \"1.2.3\"  # Follow semantic versioning\nCommit and merge to main via PR\nTrigger registration by commenting on the merge commit:\n@JuliaRegistrator register\nAutomated flow:\nJuliaRegistrator creates PR to Julia General Registry\nOnce merged (~15 minutes), TagBot automatically creates GitHub release\nDocumentation is automatically deployed for new tagged versions","category":"page"},{"location":"developer/release-process/#For-Major-Releases-(Breaking-Changes)","page":"Release Process","title":"For Major Releases (Breaking Changes)","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Plan breaking changes carefully with issue discussion\nCreate NEWS.md entry following the template above:\nDocument all breaking changes with before/after examples\nProvide comprehensive migration guidance\nInclude rationale for major changes\nAcknowledge significant contributors\nUpdate version with major version bump (e.g., 1.5.2 → 2.0.0)\nFollow same registration process as regular releases\nConsider deprecation warnings in the previous minor release","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Additional Major Release Considerations:","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Create migration documentation or guides if needed\nUpdate tutorials and examples to reflect new API\nCoordinate with downstream packages that depend on CensoredDistributions.jl\nConsider advance communication to user community via Julia Discourse or GitHub Discussions","category":"page"},{"location":"developer/release-process/#3.-Semantic-Versioning-Guidelines","page":"Release Process","title":"3. Semantic Versioning Guidelines","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Following SemVer:","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Patch (1.0.0 → 1.0.1): Bug fixes, performance improvements\nMinor (1.0.1 → 1.1.0): New features, additions to API (backwards compatible)\nMajor (1.1.0 → 2.0.0): Breaking changes to public API","category":"page"},{"location":"developer/release-process/#Examples:","page":"Release Process","title":"Examples:","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Adding new distribution types: Minor\nFixing calculation bugs: Patch\nChanging function signatures: Major\nAdding optional parameters: Minor\nRemoving deprecated functions: Major","category":"page"},{"location":"developer/release-process/#4.-Release-Notes-and-Changelog-Strategy","page":"Release Process","title":"4. Release Notes and Changelog Strategy","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"We use a hybrid changelog approach that combines the strengths of both traditional NEWS.md files and GitHub releases:","category":"page"},{"location":"developer/release-process/#Changelog-Hierarchy","page":"Release Process","title":"Changelog Hierarchy","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"GitHub Releases: Used for all releases (patch, minor, and major)\nAutomatically generated by TagBo\nProvides immediate visibility in the Julia ecosystem\nLinks to commits and PRs for detailed change tracking\nNEWS.md: Used for major releases and significant milestones\nProvides comprehensive context for breaking changes\nOffers detailed migration guidance\nFollows SciML ecosystem conventions for major version documentation","category":"page"},{"location":"developer/release-process/#Templates","page":"Release Process","title":"Templates","text":"","category":"section"},{"location":"developer/release-process/#Release-Documentation-Strategy","page":"Release Process","title":"Release Documentation Strategy","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"GitHub Releases (Minor/Patch - Automated):","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"GitHub automatically generates release notes for minor and patch releases\nUses commit messages and PR labels to categorise changes\nNo manual intervention required","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"NEWS.md Entries (Major Releases - Manual):","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Maintainers manually write detailed entries for major releases\nFocus on breaking changes, migration guidance, and significant features\nProvide context\nFollow a structured format with breaking changes, new features, and migration examples","category":"page"},{"location":"developer/release-process/#NEWS.md-Entry-Template-(Major-Releases):","page":"Release Process","title":"NEWS.md Entry Template (Major Releases):","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"# CensoredDistributions.jl v2.0.0\n\n## Breaking Changes\n\n### API Restructuring\nThe distribution constructor API has been simplified and standardised:\n\n**Before (v1.x)**:","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"julia d = PrimaryCensored(delaydist, primarydist, censoring_window)","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"\n**After (v2.0)**:","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"julia d = primarycensored(delaydist, primarydist; window=censoringwindow)","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"\n## New Features\n- Unified distribution constructor interface\n- Enhanced integration with Turing.jl v0.30+\n- Support for arbitrary primary event distributions\n\n## Performance Improvements\n- 3x faster PDF calculations for common distribution pairs\n- Reduced memory allocation in vectorised operations\n\n## Acknowledgements\nSpecial thanks to @contributor1, @contributor2 for major contributions to this\nrelease.","category":"page"},{"location":"developer/release-process/#5.-Automation-Details","page":"Release Process","title":"5. Automation Details","text":"","category":"section"},{"location":"developer/release-process/#CompatHelper","page":"Release Process","title":"CompatHelper","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Runs daily via GitHub Actions (CompatHelper.yaml)\nAutomatically updates [compat] entries in Project.toml\nCreates PRs for dependency version bumps\nHelps maintain up-to-date dependencies across Julia ecosystem","category":"page"},{"location":"developer/release-process/#TagBot","page":"Release Process","title":"TagBot","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Triggered when package appears in Julia General Registry\nAutomatically creates GitHub releases with generated changelog\nUses SSH key (DOCUMENTER_KEY) for authenticated operations\nSupports custom release notes if provided","category":"page"},{"location":"developer/release-process/#Version-Management-Actions","page":"Release Process","title":"Version Management Actions","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Runs automatically on pushes to main checking for version changes in Project.toml\nAccepts /version major|minor|patch comments on PRs from users with write permissions\nCreates patch increment PRs for main branch or commits directly to PR branches","category":"page"},{"location":"developer/release-process/#JuliaRegistrator","page":"Release Process","title":"JuliaRegistrator","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Community bot for registering packages\nOnly package collaborators can trigger registration\nValidates package before creating registry PR\nUsually completes registration within 15 minutes","category":"page"},{"location":"developer/release-process/#7.-Pre-Release-Checklis","page":"Release Process","title":"7. Pre-Release Checklis","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Before triggering @JuliaRegistrator register:","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"For All Releases:","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"[ ] All CI tests pass (including pre-commit hooks)\n[ ] Version number follows semantic versioning\n[ ] New features have tests and documentation\n[ ] Dependencies are up to date (check CompatHelper PRs)\n[ ] Examples in docstrings work correctly","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Additional Checklist for Major Releases:","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"[ ] NEWS.md entry created following template\n[ ] Breaking changes documented with migration examples\n[ ] Deprecation warnings added in previous releases (where applicable)\n[ ] Migration guide or documentation updated\n[ ] Downstream package compatibility assessed\n[ ] Community communication planned (if needed)","category":"page"},{"location":"developer/release-process/#8.-Emergency-Releases","page":"Release Process","title":"8. Emergency Releases","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"For critical bug fixes:","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Create hotfix branch from latest release tag\nApply minimal fix with tests\nBump patch version immediately\nFast-track PR review and merge\nRegister immediately with @JuliaRegistrator register","category":"page"},{"location":"developer/release-process/#9.-Coordinating-with-Julia-Ecosystem","page":"Release Process","title":"9. Coordinating with Julia Ecosystem","text":"","category":"section"},{"location":"developer/release-process/#Registry-Compatibility","page":"Release Process","title":"Registry Compatibility","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Monitor Julia ecosystem releases affecting dependencies\nTest against Julia LTS, stable, and pre-release versions in CI\nFollow Julia deprecation cycles","category":"page"},{"location":"developer/release-process/#Documentation-Releases","page":"Release Process","title":"Documentation Releases","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Major releases trigger documentation rebuilds automatically\nEnsure tutorials work with new versions\nUpdate installation instructions if Julia version requirements change","category":"page"},{"location":"developer/release-process/#10.-Troubleshooting-Releases","page":"Release Process","title":"10. Troubleshooting Releases","text":"","category":"section"},{"location":"developer/release-process/#Common-Issues:","page":"Release Process","title":"Common Issues:","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Registry PR fails: Check Project.toml syntax and version conflicts\nTagBot doesn't trigger: Verify DOCUMENTER_KEY secret is configured\nTests fail after release: Emergency patch release procedure","category":"page"},{"location":"developer/release-process/#Getting-Help:","page":"Release Process","title":"Getting Help:","text":"","category":"section"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"Check Julia Discourse for registry issues\nSciML community practices for guidance\nGitHub Issues for package-specific problems","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"","category":"page"},{"location":"developer/release-process/","page":"Release Process","title":"Release Process","text":"This process ensures reliable, frequent releases while maintaining high quality and ecosystem compatibility.","category":"page"},{"location":"getting-started/faq/#faq","page":"FAQ","title":"Frequently Asked Questions","text":"","category":"section"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"This page contains frequently asked questions about CensoredDistributions.jl. If you have a question that is not answered here, please open a discussion on the GitHub repository.","category":"page"},{"location":"getting-started/faq/#Working-with-Tutorials","page":"FAQ","title":"Working with Tutorials","text":"","category":"section"},{"location":"getting-started/faq/#Q:-How-can-I-run-the-tutorial-notebooks?","page":"FAQ","title":"Q: How can I run the tutorial notebooks?","text":"","category":"section"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"A: You have two options:","category":"page"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"Option 1: Copy and paste (easiest)","category":"page"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"Copy code blocks from the online tutorials\nPaste into your Julia REPL or script\nModify as needed for your analysis","category":"page"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"Option 2: Interactive notebooks","category":"page"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"Install Pluto: ] add Pluto\nClone the repository: git clone https://github.com/EpiAware/CensoredDistributions.jl.git\nStart Julia in the repository directory: julia --project=docs\nStart Pluto: using Pluto; Pluto.run()\nOpen the .jl files in docs/src/getting-started/tutorials/","category":"page"},{"location":"getting-started/faq/#Q:-What-are-Pluto-notebooks?","page":"FAQ","title":"Q: What are Pluto notebooks?","text":"","category":"section"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"A: Pluto.jl notebooks are reactive - when you change one cell, all dependent cells automatically update. This is different from Jupyter notebooks. Each cell contains either a single expression or code wrapped in begin...end or let...end blocks.","category":"page"},{"location":"getting-started/faq/#Using-the-Package","page":"FAQ","title":"Using the Package","text":"","category":"section"},{"location":"getting-started/faq/#Q:-How-do-I-create-a-primary-censored-distribution?","page":"FAQ","title":"Q: How do I create a primary censored distribution?","text":"","category":"section"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"A: Use the primary_censored function:","category":"page"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"using CensoredDistributions, Distributions\n\n# Delay distribution (e.g., incubation period)\ndelay_dist = Gamma(2, 3)\n\n# Primary event distribution (e.g., infection within a day)\nprimary_dist = Uniform(0, 1)\n\n# Create censored distribution\ncensored_dist = primary_censored(delay_dist, primary_dist)","category":"page"},{"location":"getting-started/faq/#Q:-What's-the-difference-between-the-different-types-of-censoring?","page":"FAQ","title":"Q: What's the difference between the different types of censoring?","text":"","category":"section"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"A:","category":"page"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"Primary event censoring: The timing of the initial event in a delay distribution is uncertain. See the tutorials for detailed examples.\nInterval censoring: Continuous values are observed only within discrete intervals. See the API documentation for interval_censored.\nDouble interval censoring: Combines both types of censoring. See double_interval_censored in the API documentation.","category":"page"},{"location":"getting-started/faq/#Q:-How-do-I-fit-censored-distributions-to-data?","page":"FAQ","title":"Q: How do I fit censored distributions to data?","text":"","category":"section"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"A: See the Fitting with Turing.jl tutorial in the tutorials section for Bayesian inference examples using Turing.jl.","category":"page"},{"location":"getting-started/faq/#Q:-Which-distributions-have-analytical-solutions-for-better-performance?","page":"FAQ","title":"Q: Which distributions have analytical solutions for better performance?","text":"","category":"section"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"A: See the Analytical CDF Solutions tutorial in the tutorials section for details on which distribution combinations have optimized implementations.","category":"page"},{"location":"getting-started/faq/#Q:-Can-I-use-this-with-automatic-differentiation?","page":"FAQ","title":"Q: Can I use this with automatic differentiation?","text":"","category":"section"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"A: Yes! The package supports ForwardDiff.jl, ReverseDiff.jl, Zygote.jl, and Enzyme.jl for use with Turing.jl and other AD-based workflows.","category":"page"},{"location":"getting-started/faq/#Common-Issues","page":"FAQ","title":"Common Issues","text":"","category":"section"},{"location":"getting-started/faq/#Q:-I-get-\"Package-not-found\"-errors","page":"FAQ","title":"Q: I get \"Package not found\" errors","text":"","category":"section"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"A: Make sure you're in the right environment:","category":"page"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"using Pkg\nPkg.activate(\".\")           # Activate current directory\nPkg.instantiate()           # Install dependencies\nPkg.add(\"CensoredDistributions\")  # Add the package if needed","category":"page"},{"location":"getting-started/faq/#Q:-How-do-I-cite-this-package?","page":"FAQ","title":"Q: How do I cite this package?","text":"","category":"section"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"A: Please cite the GitHub repository and mention the version you used. Citation information for the associated paper will be added when available.","category":"page"},{"location":"getting-started/faq/#Q:-I-want-to-contribute-to-development","page":"FAQ","title":"Q: I want to contribute to development","text":"","category":"section"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"A: See the Developer FAQ and Contributing Guide for development-specific questions and guidelines.","category":"page"},{"location":"getting-started/faq/#Getting-Help","page":"FAQ","title":"Getting Help","text":"","category":"section"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"Still have questions?","category":"page"},{"location":"getting-started/faq/","page":"FAQ","title":"FAQ","text":"Package-specific: Open a GitHub Discussion\nGeneral Julia help: Julia Discourse or Julia Slack\nBug reports: GitHub Issues","category":"page"},{"location":"#CensoredDistributions.jl","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl","text":"","category":"section"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"(Image: Stable) (Image: Dev) (Image: Test) (Image: codecov)","category":"page"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"(Image: SciML Code Style) (Image: Aqua QA) (Image: JET)","category":"page"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"(Image: License: MIT)","category":"page"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"Additional censored event tools for Distributions.jl","category":"page"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"Websites: Organization Website | Documentation","category":"page"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"CensoredDistributions.jl Stats: (Image: CensoredDistributions Stars)","category":"page"},{"location":"#Why-CensoredDistributions.jl?","page":"CensoredDistributions.jl: Primary event censored distributions","title":"Why CensoredDistributions.jl?","text":"","category":"section"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"Primary event censoring: Model delay distributions where the initial event occurs within a time window (e.g., exposure periods in epidemiology).\nInterval censoring: Bin continuous distributions into discrete intervals (e.g., daily reporting) when exact values are not observed.\nDouble interval censoring: Combines both primary event and interval censoring for complex observation processes.\nDistribution fitting: Extends Distributions.jl's fit support with MLE fitting for primary censored and interval censored distributions (potentially truncated), plus Turing.jl integration for Bayesian inference.\nAnalytical solutions: Provides analytical solutions where possible with numerical fallbacks for efficiency.","category":"page"},{"location":"#What-can-I-do-with-CensoredDistributions.jl?","page":"CensoredDistributions.jl: Primary event censored distributions","title":"What can I do with CensoredDistributions.jl?","text":"","category":"section"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"Create distributions that are modified to account for primary event censoring and interval censoring.\nApply interval censoring to continuous distributions (both regular and arbitrary intervals).\nGenerate random samples from censored distributions.\nCalculate the probability density function (PDF) and cumulative distribution function (CDF) of censored event distributions.\nCalculate the PDF of interval-censored distributions.\nCalculate the mean, variance, and other moments of censored event distributions.\nFit censored event distributions using Turing.jl for both Bayesian inference and MLE methods.","category":"page"},{"location":"#Getting-Started","page":"CensoredDistributions.jl: Primary event censored distributions","title":"Getting Started","text":"","category":"section"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"For comprehensive tutorials and guides, see our Getting Started documentation.","category":"page"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"The following example demonstrates how to create a double interval censored distribution (combines primary event, interval censoring, and right truncation (using Distributions.truncated)):","category":"page"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"using CensoredDistributions, Distributions, Plots\n\n# Create a censored distribution accounting for primary and secondary censoring\noriginal = Gamma(2, 3)\ncensored = double_interval_censored(original; upper = 15, interval = 1)\n\n# Compare the distributions\nx = 0:0.01:20\nplot(x, pdf.(original, x), label = \"Original Gamma\", lw = 2)\nplot!(x, pdf.(censored, x), label = \"Double Censored and right truncated\", lw = 2)","category":"page"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"You can fit censored distributions to data using Turing.jl for both Bayesian inference and MLE methods, as well as other optimization-based approaches:","category":"page"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"using Turing\n\n# Generate synthetic data from the censored distribution\ndata = rand(censored, 1000)\n\n# Get counts of unique values for weighted likelihood\nvalues = unique(data)\nweights = [count(==(val), data) for val in values]\n\n# Define a Turing model for fitting with weighted likelihood\n@model function double_censored_model(values, weights)\n    # Priors for Gamma parameters - weakly informative, not centered on true values\n    α ~ truncated(Normal(1, 2), 0, Inf)\n    θ ~ truncated(Normal(1, 2), 0, Inf)\n\n    # Create the censored distribution\n    censored_dist = double_interval_censored(Gamma(α, θ); upper = 15, interval = 1)\n\n    # Vectorized weighted likelihood\n    values ~ weight(censored_dist, weights)\nend\n\n# Fit using MLE or other methods\nmodel = double_censored_model(values, weights)\n\n# Fit using MCMC for Bayesian inference\nchain = sample(model, NUTS(), MCMCThreads(), 1000, 2; progress = false)\nsummarize(chain)","category":"page"},{"location":"#Relationship-to-Distributions.jl","page":"CensoredDistributions.jl: Primary event censored distributions","title":"Relationship to Distributions.jl","text":"","category":"section"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"Both CensoredDistributions.jl and Distributions.jl's built-in censored() function handle censoring, but they address different types of uncertainty:","category":"page"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"Aspect Distributions.jl censored() CensoredDistributions.jl\nType Observation censoring Event timing censoring\nQuestion \"Can't measure outside bounds?\" \"Don't know exactly when it happened?\"\nExample Lab test detection limits Disease onset within time window\nUse case Measurement limitations Epidemiological modeling","category":"page"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"These approaches complement each other - you can apply observation limits to distributions with event timing uncertainty when both types of censoring affect your data.","category":"page"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"CensoredDistributions.jl also works well with truncated() from Distributions.jl and supports both primary event censoring (initial event timing uncertainty) and secondary event censoring (observation window effects).","category":"page"},{"location":"#What-packages-work-well-with-CensoredDistributions.jl?","page":"CensoredDistributions.jl: Primary event censored distributions","title":"What packages work well with CensoredDistributions.jl?","text":"","category":"section"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"Distributions.jl provides the base functionality for working with distributions as well as tools for frequentist inference of distributions.\nTuring.jl for Bayesian inference of censored distributions. CensoredDistributions.jl is designed (and tested) to work well with Turing.jl.","category":"page"},{"location":"#Where-to-learn-more","page":"CensoredDistributions.jl: Primary event censored distributions","title":"Where to learn more","text":"","category":"section"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"Want to get started running code? Check out the Getting Started Tutorials.\nWant to understand the API? Check out our API Reference.\nWant to chat with someone about CensoredDistributions? Post on our GitHub Discussions.\nWant to contribute to CensoredDistributions? Check out our Developer Documentation.\nWant to see our code? Check out our GitHub Repository.","category":"page"},{"location":"#Contributing","page":"CensoredDistributions.jl: Primary event censored distributions","title":"Contributing","text":"","category":"section"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"We welcome contributions and new contributors! We particularly appreciate help on identifying and identified issues. Please check and add to the issues, and/or add a pull request and see our developer documentation for more information.","category":"page"},{"location":"#Code-of-Conduct","page":"CensoredDistributions.jl: Primary event censored distributions","title":"Code of Conduct","text":"","category":"section"},{"location":"","page":"CensoredDistributions.jl: Primary event censored distributions","title":"CensoredDistributions.jl: Primary event censored distributions","text":"Please note that the CensoredDistributions project is released with a Contributor Code of Conduct. By contributing to this project, you agree to abide by its terms.","category":"page"}]
